roup, but it is unclear from open source information if the groups are the same.','2023-03-20 15:09:36','2023-03-20 15:09:36',NULL),(1987,83,'XSLCmd OSX Backdoor',NULL,'https://www.fireeye.com/blog/threat-research/2014/09/forced-to-adapt-xslcmd-backdoor-now-on-os-x.html',NULL,'FireEye Labs recently discovered a previously unknown variant of the APT backdoor XSLCmd – OSX.XSLCmd – which is designed to compromise Apple OS X systems. This backdoor shares a significant portion of its code with the Windows-based version of the XSLCmd backdoor that has been around since at least 2009.','2023-03-24 11:04:08','2019-08-08 14:57:30','5544c0d3b45ff53b128efa6b'),(1988,516,'An Intelligence Report on the Winnti Umbrella and Associated State-Sponsored Attackers',NULL,'https://401trg.pw/burning-umbrella/',NULL,'We assess with high confidence that the Winnti umbrella is associated with the Chinese state intelligence apparatus, with at least some elements located in the Xicheng District of Beijing.\n\nA number of Chinese state intelligence operations from 2009 to 2018 that were previously unconnected publicly are in fact linked to the Winnti umbrella.\n\nWe assess with high confidence that multiple publicly reported threat actors operate with some shared goals and resources as part of the Chinese state intelligence apparatus. Report from Tom Hegel of 401TRG.\n\nInitial attack targets are commonly software and gaming organizations in United States, Japan, South Korea, and China. Later stage high profile targets tend to be politically motivated or high value technology organizations.','2023-03-24 11:04:08','2019-11-25 15:17:27','5aec1ab38170f445dbd22f2b'),(1989,89,'Double Dragon: A dual espionage and cyber crime operation',NULL,'https://content.fireeye.com/apt-41/rpt-apt41',NULL,'A report from FireEye on APT41. See reference for complete report.','2023-03-24 11:04:10','2019-08-22 20:41:42','5d4ae9f31ae8a479422a17ab'),(1990,4,'Technical Analysis of Crosswalk','Crosswalk','https://www.carbonblack.com/2019/09/30/cb-threat-analysis-unit-technical-analysis-of-crosswalk/,https://www.fireeye.com/blog/threat-research/2019/08/apt41-dual-espionage-and-cyber-crime-operation.html',NULL,'FireEye recently reported on APT41, a Chinese state sponsored espionage group. The group has been documented as targeting  healthcare, high-tech, and telecommunications companies for traditional corporate espionage purposes.  Additionally this group has also targeted companies in the video game industry for financial gain. Crosswalk is a modular backdoor application that gathers system information and is capable of executing shell code in response to C2 messages.','2023-03-24 11:04:10','2019-11-03 00:00:08','5d97a0e80a5ef985c6966b6e'),(1991,22,'LOWKEY: Hunting for the Missing Volume Serial ID',NULL,'https://www.fireeye.com/blog/threat-research/2019/10/lowkey-hunting-for-the-missing-volume-serial-id.html,https://www.welivesecurity.com/2019/10/14/connecting-dots-exposing-arsenal-methods-winnti/',NULL,'In August 2019, FireEye released the “Double Dragon” report on our newest graduated threat group: APT41. A China-nexus dual espionage and financially-focused group, APT41 targets industries such as gaming, healthcare, high-tech, higher education, telecommunications, and travel services. This blog post is about the sophisticated passive backdoor we track as LOWKEY, mentioned in the APT41 report, and associated with ESETs recent Winnti Group related blog https://www.welivesecurity.com/2019/10/14/connecting-dots-exposing-arsenal-methods-winnti/ .','2023-03-24 11:04:10','2019-10-15 15:50:03','5da5eaab4516e8056a6d59fb'),(1992,3,'MESSAGETAP: Who’s Reading Your Text Messages?','MessageTap','https://www.fireeye.com/blog/threat-research/2019/10/messagetap-who-is-reading-your-text-messages.html',NULL,'FireEye Mandiant recently discovered a new malware family used by APT41 (a Chinese APT group) that is designed to monitor and save SMS traffic from specific phone numbers, IMSI numbers and keywords for subsequent theft. Named MESSAGETAP, the tool was deployed by APT41 in a telecommunications network provider in support of Chinese espionage efforts. APT41’s operations have included state-sponsored cyber espionage missions as well as financially-motivated intrusions. These operations have spanned from as early as 2012 to the present day. For an overview of APT41, see our August 2019 blog post or our full published report. MESSAGETAP was first reported to FireEye Threat Intelligence subscribers in August 2019 and initially discussed publicly in an APT41 presentation at FireEye Cyber Defense Summit 2019.','2023-03-24 11:04:10','2019-10-31 14:36:37','5dbaf17560ad85a32e201d03'),(1993,81,'The BfV Cyber-Brief No. 01/2019 - Winnti Activity',NULL,'https://www.verfassungsschutz.de/de/oeffentlichkeitsarbeit/publikationen/pb-cyberabwehr/broschuere-2019-12-bfv-cyber-brief-2019-01,https://twitter.com/hatr/status/1202870566413357056',NULL,'Germany\'s Federal Office for the Protection of the Constitution (BfV) has released a report related to the Chinese based Winnti Group (APT41). Please see reference to download full report. Some host based detection/hunting techniques from the report are not in this pulse.','2023-03-24 11:04:10','2019-12-06 16:24:36','5dea7c18581fca35d1977514'),(1994,2,'APT41 Recent Backdoor Samples','Winnti',NULL,NULL,'Recent samples identified as similar to APT41s HIGHNOON/Winnti (backdoor).','2023-03-24 11:04:10','2019-12-17 21:43:37','5df94c09f9a3cb32a5402b69'),(1995,55,'This Is Not a Test: APT41 Initiates Global Intrusion Campaign Using Multiple Exploits',NULL,'https://www.fireeye.com/blog/threat-research/2020/03/apt41-initiates-global-intrusion-campaign-using-multiple-exploits.html',NULL,'Beginning this year, FireEye observed Chinese actor APT41 carry out one of the broadest campaigns by a Chinese cyber espionage actor we have observed in recent years.','2023-03-24 11:04:10','2020-03-25 14:28:42','5e7b4a11d552fbcfce6c314d'),(1996,20,'Analysis of 