oups',NULL,'https://symantec-enterprise-blogs.security.com/blogs/threat-intelligence/apt41-indictments-china-espionage',NULL,'\"Seven men have been charged in the U.S. in relation to attacks by China-linked espionage operation which Symantec monitors as two distinct groups – Blackfly and Grayfly\"','2023-03-24 11:04:16','2020-09-18 14:36:59','5f64c60b933db16a4f43dffb'),(2002,20,'The attack chain of APT41s ransomware incidents in Taiwan',NULL,'https://www.trendmicro.com/en_us/research/20/i/u-s--justice-department-charges-apt41-hackers-over-global-cyberattacks.html#.X2TkSOrVA6I.twitter,https://medium.com/cycraft/china-linked-threat-group-targets-taiwan-critical-infrastructure-smokescreen-ransomware-c2a155aa53d5',NULL,'\"The Trend Micro Research team investigated the ColdLock ransomware attack, which actually targeted the energy industry in Taiwan.\"','2023-03-24 11:04:16','2021-06-11 17:14:02','5f650a34fabdf2c7bf7a7616'),(2003,24,'Analyzing BestCrypt Ransomware / Dtrack / Cobalt Strike Incident','BestCrypt,Cobalt Strike,Dtrack','https://blog.macnica.net/blog/2020/11/dtrack.html',NULL,'\"In this article, we will share the analysis results of incidents in which data encryption and money of the core system server were requested after the network was invaded at the overseas bases of domestic companies that we have dealt with in the past, and used them for studying countermeasures. It is described with the aim of having you do it.\"','2023-03-24 11:04:16','2020-11-27 16:54:07','5fc12f0ec26699f8ccd97838'),(2004,27,'Targeted attack by Cobalt Strike loader that abuses Microsoft\'s digital signature - Attacker group APT41','Cobalt Strike,SigLoader','https://www.lac.co.jp/lacwatch/report/20210521_002618.html',NULL,'Lac Watch has been observing attacks using SigLoader (also known as DESLoader, Ecipekac) since the beginning of 2021. This series of attacks using SigLoader was reported at the Japan Security Analyst Conference (JSAC) in January 2021 and also as an attack campaign A41APT on Kaspersky\'s blog in March 2021.\nWhile investigating attacks that exploit Sigloader, Lac Watch has identified multiple malware \"Cobalt Strike loader\" that exploits Microsoft\'s digitally signed DLL files, which is different from SigLoader . This is an introduction to the relationship between this Cobalt Strike loader and the attacker group \"APT41\" hidden behind it.','2023-03-24 11:04:16','2021-05-24 13:31:45','60ab8cd7392de69e16357d02'),(2005,28,'APT41 likely behind supply chain attack to big airline heist','Cobalt Strike,BadPotato','https://blog.group-ib.com/colunmtk_apt41',NULL,'A security breach caused by a Chinese nation-state cyberattack in 2021 could have significant implications for the airline industry, according to security researcher Group-IB.','2023-03-24 11:04:16','2021-07-11 00:04:52','60c34510bd6707ce53355efc'),(2006,76,'Earth Baku: An APT Group Targeting Indo-Pacific Countries  With New Stealth Loaders and Backdoor','StealthMutant,ScrambleCross,StealthVector,Cobalt Strike - S0154','https://documents.trendmicro.com/assets/white_papers/wp-earth-baku-an-apt-group-targeting-indo-pacific-countries.pdf',NULL,'An APT group known as Earth Baku has updated its arsenal of malware tools to target companies in the Indo-Pacific region. Earth Baku, a cyberespionage and cybercriminal group, was charged by the US Department of Justice in August 2020 with computer intrusion offenses related to data theft, ransomware, and cryptocurrency mining attacks.','2023-03-24 11:04:23','2021-10-10 00:01:20','613b110f3e005c40fe57317d'),(2007,59,'Drawing a Dragon: Connecting the Dots to Find APT41','Cobalt Strike,APT41','https://blogs.blackberry.com/en/2021/10/drawing-a-dragon-connecting-the-dots-to-find-apt41',NULL,'The BlackBerry Research & Intelligence Team recently connected seemingly disparate malware campaigns, which began with an unusual Cobalt Strike configuration that was first included in a blog post published the same month as COVID-19 lockdowns began in Europe and the U.S. What we found led us through a malicious infrastructure that had been partially documented in articles by several other research organizations.','2023-03-24 11:04:23','2021-11-05 00:03:46','615da9a8e2c277e1749757c3'),(2008,27,'MoonBounce: the dark side of UEFI firmware','MoonBounce,StealthMutant,Microcin','https://securelist.com/moonbounce-the-dark-side-of-uefi-firmware/105468/',NULL,'In the last year, there have been several public accounts on the ongoing trend of UEFI threats. Notable examples include the UEFI bootkit used as part of the FinSpy surveillance toolset,  the ESPectre bootkit, or a little-known threat activity that was discovered within in the Middle East, using a UEFI bootkit on its own. The common denominator of those three cases is the fact that the UEFI components targeted for infection reside on the ESP (EFI System Partition), a storage space designated for some UEFI components.','2023-03-24 11:04:23','2022-02-20 00:05:37','61ea8f0fe72ea3d1783f483a'),(2009,28,'A Summary of APT41 Targeting U.S. State Governments','KEYPLUG,APT41,ViewState,Cobalt Strike - S0154','https://www.mandiant.com/resources/apt41-us-state-governments',NULL,'In May 2021 Mandiant responded to an APT41 intrusion targeting a United States state government computer network. This was just the beginning of Mandiant’s insight into a persistent months-long campaign conducted by APT41 using vulnerable Internet facing web applications as their initial foothold into networks of interest. APT41 is a prolific Chinese state-sponsored espionage group known to target organisations in both the public and private sectors and also conducts financially motivated activity for personal gain.','2023-03-24 11:04:32','2022-04-08 00:05:40','62289a2860941a0185c1c221'),(2010,15,'APT41 World Tour 2021 on a tight schedule','Cobalt Strike,StealthMutant','https://blog.group-ib.com/apt41-world-tour-2021',NULL,'In March 2022 one of the oldest state-sponsored hacker groups, APT41, breached government networks in six US states, including by exploiting a vulnerability in a livestock management system, Mandiant investigators have reported.','2023-03-24 11:04:32','2022-09-23 00:00:05','630615f326d4b91e473170fe'),(2011,0,'APT41 ','Fireeye','https://content.fireeye.com/apt-41/rpt-apt41','','APT41 is a threat group that researchers have assessed as Chinese state-sponsored espionage group that also conducts financially-motivated operations. Active since at least 2012, APT41 has been observed targeting healthcare, telecom, technology, and video game industries in 14 countries. \n','2023-03-24 11:12:00','2023-03-24 11:53:14',NULL),(2012,43,'Delving Deep: An Analysis of Earth Lusca’s Operations','ShadowPad,Winnti,Cobalt Strike,FunnySwitch,BIOPASS,Doraemon,Shadowpad,AntSword','https://www.trendmicro.com/content/dam/trendmicro/global/en/research/22/a/earth-lusca-employs-sophisticated-infrastructure-varied-tools-and-techniques/technical-brief-delving-deep-an-analysis-of-earth-lusca-operations.pdf',NULL,'An analysis of Earth Lusca’s cyberespionage operations has revealed details of the Chinese threat actor\'s operations, and how it targets targets in a variety of countries and regions.','2023-03-28 18:18:01','2022-01-17 16:54:33','61e59f497022f0fb28114f96'),(2013,24,'Royal Cyber','URL\'s, ransomware','','Attack','Royal Ransom IOCs\" and most of the vendors do not have any signatures for these.','2023-03-31 15:38:52','2023-03-31 15:38:52',NULL),(2014,44,'Fake Cryptocurrency Applications Serving as Front for AppleJeus Malware',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2015,8,'Not just an infostealer: Gopuram backdoor deployed through 3CX supply chain attack',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2016,300,'Following the Lazarus group by tracking DeathNote campaign',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2017,30,'Lazarus Threat Group Exploiting Vulnerability of Korean Finance Security Solution',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2018,28,'APT10: Tracking down LODEINFO 2022','LODEINFO','https://securelist.com/apt10-tracking-down-lodeinfo-2022-part-ii/107745/,https://securelist.com/apt10-tracking-down-lodeinfo-2022-part-i/107742/',NULL,'Kaspersky researchers have been tracking the LODEINFO backdoor over the last few years. LODEINFO is sophisticated fileless malware first named in a blog post from JPCERT/CC in February 2020. The malware was regularly modified and upgraded by the developers to target media, diplomatic, governmental and public sector organizations and think tanks in Japan','2023-07-14 00:10:07','2022-11-30 12:00:59','635feefe445afd0f45c41767'),(2019,49,'FIN7 Power Hour: Adversary Archaeology and the Evolution of FIN7','FIN7','https://www.mandiant.com/resources/evolution-of-fin7',NULL,'Recent public research asserts threat groups sharing overlaps with FIN7 transitioned to targeted ransomware operations involving REVIL, DARKSIDE, BLACKMATTER, and ALPHV ransomware.','2023-07-14 00:10:27','2022-04-05 14:11:58','624c4e2fe492d9e618422ffc'),(2020,17,'JSSLoader: the shellcode edition','JSSLoader','https://malwarebytes.app.box.com/s/ym6r7o5hq0rx2nxjbctfv2sw5vx386ni',NULL,'Security researchers observed a malspam campaign in late June attributed to the FIN7 APT group. One of the samples was also reported on Twitter; during execution, it was observed to drop a secondary payload, written in .NET. Earlier this year, a new component used by this group was identified, delivered in XLL format. That element was the first step in the attack chain leading to another malware, dubbed JSSLoader.','2023-07-14 00:10:27','2022-08-19 11:05:21','62ff6e72af34244dea7bb99e'),(2021,21,'Noberus Ransomware: Darkside and BlackMatter Successor Continues to Evolve its Tactics','Noberus,BlackMatter,Eamfo','https://symantec-enterprise-blogs.security.com/blogs/threat-intelligence/noberus-blackcat-ransomware-ttps',NULL,'Attackers deploying the Noberus (aka BlackCat, ALPHV) ransomware have been using new tactics, tools, and procedures (TTPs) in recent months, making the threat more dangerous than ever. Among some of the more notable developments has been the use of a new version of the Exmatter data exfiltration tool, and the use of Eamfo, information-stealing malware that is designed to steal credentials stored by Veeam backup software.','2023-07-14 00:10:27','2022-09-22 14:30:24','632c71813d73b773f1dd81f8'),(2022,134,'Black Basta Ransomware | Attacks Deploy Custom EDR Evasion Tools Tied to FIN7 Threat Actor','Black Basta','https://www.sentinelone.com/labs/black-basta-ransomware-attacks-deploy-custom-edr-evasion-tools-tied-to-fin7-threat-actor/',NULL,'SentinelLabs has published its report on the Black Basta ransomware group, which has infected more than 90,000 organisations since April 2022 and is believed to be linked to a single threat actor.','2023-07-14 00:10:27','2022-12-03 12:04:08','6363be4e63994f523414639c'),(2023,254,'Fin7 Unveiled: A deep dive into notorious cybercrime gang',NULL,'https://www.prodaft.com/resource/detail/fin7-unveiled-deep-dive-notorious-cybercrime-gang',NULL,'The highly active threat group FIN7 has been continuously broadening their cybercrime horizons and recently added ransomware to its attack arsenal. FIN7 group is known to hold a notorious status due to their achievement in deploying extensive backdoors in leveraging software supply chains, distributing malicious USB sticks, and cooperating with other groups.\n\nPTI team obtained visibility into the inner workings of the FIN7 threat group and managed to gain information about their organizational structures, identities, attack vectors, infrastructures, proof-supported affiliations with other ransomware groups (such as DarkSide, who were behind the Colonial Pipeline attack in 2021), victim targeting, and other relevant observations. All of the findings are supported by translated conversations among the members of FIN7, including screenshots of their infrastructures.','2023-07-14 00:10:31','2022-12-23 12:49:19','63a5a3d0765aef678afbc794'),(2024,12,'FIN7 tradecraft seen in attacks against Veeam backup servers','Cobalt Strike','https://labs.withsecure.com/publications/fin7-target-veeam-servers,https://github.com/WithSecureLabs/iocs/blob/master/FIN7VEEAM/iocs.csv',NULL,'WithSecure Intelligence has identified and identified a threat actor using the same tradecraft seen in attacks against Veeam Backup & Replication servers in late March 2023, and has attributed the group to FIN7.','2023-07-14 00:10:32','2023-05-01 13:10:06','644fba2f90a79e3c80210c1e'),(2025,20,'New MuddyWater Threat: Old Kitten; New Tricks',NULL,'https://www.deepinstinct.com/blog/new-muddywater-threat-old-kitten-new-tricks',NULL,'A new MuddyWater threat campaign has been discovered by Deep Instinct Threat Lab, which has identified the Iranian-based cyber espionage group in a series of attacks across the Middle East and Africa.','2023-07-14 00:11:00','2022-12-09 19:01:29','6393860bb19549d32b60f0e3'),(2026,63,'Tracking MuddyWater’s infrastructure',NULL,NULL,NULL,'As a result of the ongoing military conflict, state-sponsored hackers have been more active, as we forecasted in the report Hi-Tech Crime Trends 2022/2023. Most attackers have engaged in cyber espionage against neighboring countries. One such group is MuddyWater.','2023-07-14 00:11:04','2023-04-18 19:51:38','643ef4cbb321f0007f108229'),(2027,11,'Investigating Intrusions From Intriguing Exploits','Truebot','https://www.huntress.com/blog/investigating-intrusions-from-intriguing-exploits',NULL,'Share on LinkedIn\nShare on Facebook\nShare on Reddit\nSummary\nOn 02 February 2023, an alert triggered in a Huntress-protected environment. At first glance, the alert itself was fairly generic - a combination of certutil using the urlcache flag to retrieve a remote resource and follow-on scheduled task creation - but further analysis revealed a more interesting set of circumstances. By investigating the event in question and pursuing root cause analysis (RCA), Huntress was able to link this intrusion to a recently-announced vulnerability as well as to a long-running post-exploitation framework linked to prominent ransomware groups.','2023-07-14 00:12:35','2023-03-12 13:05:10','63e6465d009454dd6a14fea5'),(2028,20,'Blind Eagle Deploys Fake UUE Files and Fsociety to Target Colombia\'s Judiciary, Financial, Public, and Law Enforcement Entities','AsyncRAT','https://blogs.blackberry.com/en/2023/02/blind-eagle-apt-c-36-targets-colombia',NULL,'APT-C-36, also known as Blind Eagle, has been actively targeting organizations in Colombia and Ecuador since at least 2019. It relies on spear-phishing emails sent to specific and strategic companies to conduct its campaigns.','2023-07-14 00:14:13','2023-03-31 15:19:54','63ff6fd1da7f36d6fd333832'),(2029,29,'APT-C-36 (Blind Eagle) Group Deploys LimeRAT Components Against Colombia',NULL,'https://mp-weixin-qq-com.translate.goog/s?__biz=MzUyMjk4NzExMA%3D%3D&mid=2247492492&idx=1&sn=5cfd1606d6a3349c8cf0d8e1edba5c84&chksm=f9c1d085ceb65993c5e925e7eaeb91a9318a284573a42c36276f8c6c283ee10032e67fb4f47f&scene=178&cur_album_id=1955835290309230595&_x_tr_sl=auto&_x_tr_tl=en&_x_tr_hl=en&_x_tr_pto=wapp',NULL,'APT-C-36 (Blind Eagle) is an APT organization suspected to be from South America. Its main targets are located in Colombia, as well as other countries and regions in South America, such as Ecuador and Panama. Since its discovery in 2018, the group has continued to launch attacks against Colombia. Even though security vendors have successively captured and disclosed their attack activities in the past two years, they have not stopped APT-C-36\'s actions and lurking, and its attacks have become more and more intense.','2023-07-14 00:14:13','2023-04-20 20:15:06','64419d343c9d98fc279185f7'),(2030,0,'attachk 1','cydeaTech','skji\nsdksj\ndksdj','CydeaTech2','kajakj .......................... sdkskjk','2023-07-20 12:04:21','2023-07-20 12:04:21',NULL),(2031,0,'apt 10023','ssskj','source 1\nsource 2\nsource 3','lsldk','djoewutt    jjdk jk\ndjk\njkhij  kkya hal h\n','2023-07-20 12:17:35','2023-07-20 12:17:35',NULL),(2032,0,'ATTACK 1','mETHOD 1','SOURCE 1','GOOD','KJKDSK','2023-07-20 13:05:36','2023-07-20 13:05:36',NULL),(2033,0,'jkd','jks','dk','kd','kdsk','2023-07-20 13:19:54','2023-07-20 13:19:54',NULL),(2034,0,'Test Camp','fdgfdgfdgfd','fdgfd','ggfdg','fdgdfgfdgfdg','2023-07-20 16:27:57','2023-07-20 16:27:57',NULL),(2035,2,'ewrwer','','','','','2023-07-20 16:29:59','2023-07-20 16:29:59',NULL),(2036,12,'sdsadasdasd','asdsa','dasdas','dasdsa','dadsa','2023-07-20 16:48:14','2023-07-20 16:48:14',NULL),(2037,2,'Lazarus Threat Group Attacking Windows Servers to Use as Malware Distribution Points','Lazarus,JuicyPotato','https://asec.ahnlab.com/en/55369/',NULL,'A security update is needed for systems that have not been updated to the latest version of INISAFE CrossWeb EX V3, which is a vulnerability used by the Lazarus threat group to distribute malware.','2023-07-25 00:01:17','2023-07-24 13:00:02','64be75d3992df5fcffd61300'),(2038,0,'xyz','method 1','source 1','characteristics 1','sksk sk sjk k','2023-07-31 11:11:52','2023-07-31 11:11:52',NULL),(2039,4,'wqeqwe','wqewq','wqeqw','wqew','wqeqw','2023-08-04 14:41:52','2023-08-04 14:41:52',NULL),(2040,20,'Lazarus Group\'s infrastructure reuse leads to discovery of new malware','CollectionRAT,QuiteRAT,DeimosC2','https://blog.talosintelligence.com/lazarus-collectionrat/',NULL,'In the Lazarus Group’s latest campaign, which is detailed in a recent blog, the North Korean state-sponsored actor is exploiting CVE-2022-47966, a ManageEngine ServiceDesk vulnerability to deploy multiple threats. In addition to their “QuiteRAT” malware, which is covered in the blog, it was also discovered Lazarus Group is using a new threat called “CollectionRAT.”','2023-08-25 00:03:53','2023-09-23 14:03:05','64e76f372e57767067edc4dd'),(2041,33,'Lazarus luring employees with trojanized coding challenges: The case of a Spanish aerospace company',NULL,'https://www.welivesecurity.com/en/eset-research/lazarus-luring-employees-trojanized-coding-challenges-case-spanish-aerospace-company/',NULL,'The fake recruiter contacted the victim via LinkedIn Messaging, a feature within the LinkedIn professional social networking platform, and sent two coding challenges required as part of a hiring process, which the victim downloaded and executed on a company device. The first challenge is a very basic project that displays the text “Hello, World!”, the second one prints a Fibonacci sequence – a series of numbers in which each number is the sum of the two preceding ones. ESET Research was able to reconstruct the initial access steps and analyze the toolset used by Lazarus thanks to cooperation with the affected aerospace company.','2023-09-30 00:01:27','2023-10-29 14:01:08','6516dc1c66c2a9a03166669f'),(2042,94,'Analysis Report on Lazarus Threat Group’s Volgmer and Scout Malware','Scout,Volgmer','https://asec.ahnlab.com/en/57685/',NULL,'The AhnLab Security Emergency Response Center (ASEC) is tracking attacks by the seemingly state-sponsored Lazarus threat group, and in this blog post, they examine the two major malware strains used in their attacks.','2023-10-17 00:04:18','2023-10-16 16:00:56','652d5e396771a72c6468d3cc'),(2043,66,'Updated MATA attacks industrial companies in Eastern Europe','Linux MATA,Lamberts,Five Eyes,MataDoor,MATA','https://media.kasperskycontenthub.com/wp-content/uploads/sites/43/2023/10/18092216/Updated-MATA-attacks-Eastern-Europe_full-report_ENG.pdf',NULL,'Expanding Kaspersky\'s research scope, Kaspersky investigated and discovered additional, new, active actor campaigns with full infection chains, including an implant designed to work within air-gapped networks over USB sticks, as well as a Linux MATA backdoor.','2023-10-22 00:03:46','2023-11-19 22:01:47','6532ff7bdf2fef73982ab50d'),(2044,48,'A cascade of compromise: unveiling Lazarus\' new campaign','LPEClient,SIGNBT','https://securelist.com/unveiling-lazarus-new-campaign/110888/',NULL,'Security firm Kaspersky has identified and identified the malware used in a series of attacks carried out by the group known as Lazarus, which has previously targeted high-profile companies and the cryptocurrency industry.','2023-10-30 00:04:38','2023-10-27 18:50:40','653c0681ae38ba0d7d84e538'),(2045,38,'MuddyWater eN-Able spear-phishing with new TTPs',NULL,'https://www.deepinstinct.com/blog/muddywater-en-able-spear-phishing-with-new-ttps',NULL,'Previous research showed that MuddyWater has sent spear-phishing emails, starting back in 2020, with direct links, as well as PDF, RTF, and HTML attachments containing links to archives hosted on various file-sharing platforms.\nThose archives contained installers for various legitimate remote administration tools.\nBefore launching the new campaign during the Israel-Hamas war, MuddyWater reused previously known remote administration tools, utilizing a new file-sharing service called “Storyblok.”','2023-11-04 00:01:54','2023-12-03 16:02:28','65452439b44fa39b0e5b1afc'),(2046,19,'Analysis of activities of suspected APT-C-36 (Blind Eagle) organization launching Amadey botnet Trojan',NULL,'https://mp.weixin.qq.com/s/-7U1-NTP0EdVOtptzbHUsg',NULL,'In daily hunting activities, Weixin discovered that the APT-C-36 organization recently attempted to add the Amadey botnet Trojan to its usual PDF spear phishing attack flow. The Amadey botnet Trojan is a modular botnet Trojan that appeared for sale on Russian hacker forums around October 2018. It has the capabilities of intranet traversal, information theft, remote command execution, script execution, and DDos attacks.','2023-11-04 00:04:36','2023-11-03 10:00:33','6544c4c1db5b0874008a4f12'),(2047,24,'From Albania to the Middle East: The Scarred Manticore is Listening',NULL,'https://research.checkpoint.com/2023/from-albania-to-the-middle-east-the-scarred-manticore-is-listening/',NULL,'Check Point Research, in collaboration with Sygnia’s Incident Response Team, has been tracking and responding to the activities of Scarred Manticore, an Iranian nation-state threat actor that primarily targets government and telecommunication sectors in the Middle East. Scarred Manticore, linked to the prolific Iranian actor OilRig (a.k.a APT34, EUROPIUM, Hazel Sandstorm), has persistently pursued high-profile organizations, leveraging access to systematically exfiltrate data using tailor-made tools.','2023-11-04 00:04:49','2023-11-03 16:18:36','65451d5db2e4442b6ec3e9a4'),(2048,48,'MuddyC2Go – Latest C2 Framework Used by Iranian APT MuddyWater Spotted in Israel',NULL,'https://www.deepinstinct.com/blog/muddyc2go-latest-c2-framework-used-by-iranian-apt-muddywater-spotted-in-israel',NULL,'A previously unreported C2 framework suspected to be in use by the MuddyWater APT group is now being used by an unknown group.','2023-11-11 00:04:26','2023-12-09 14:00:27','654cebe5f4bb9281496a1b4b'),(2049,0,'fawad','fsadsa','dasdasd','dfsad','dsad','2024-01-09 16:14:39','2024-01-09 16:14:39',NULL),(2050,0,'fwawd','','','','','2024-01-09 16:57:44','2024-01-09 16:57:44',NULL),(2051,7,'fawad us testing','this is for testing','this is the sourvce of the tst','testing is the special chracter','summary of the specail characters ','2024-01-09 17:51:09','2024-01-09 17:51:09',NULL),(2052,10,'fwad','fas','fasd','fas','fas','2024-01-09 18:15:58','2024-01-09 18:15:58',NULL),(2053,6,'my test','add','dqw','dqd','wqdq','2024-01-10 04:24:43','2024-01-10 04:24:43',NULL),(2054,20,'VajraSpy: A Patchwork of espionage apps','TikTalk,VajraSpy','https://www.welivesecurity.com/en/eset-research/vajraspy-patchwork-espionage-apps/',NULL,'ESET researchers have identified 12 Android espionage apps that were available on Google Play between 2021 and 2023 and are still available in the wild, but not on alternative app stores, as previously thought.','2024-02-03 00:03:44','2024-02-02 12:00:07','65bcd94818f29ad82d83f035'),(2055,19,'Warning of North Korean cyber threats targeting the Defense Sector',NULL,'https://www.verfassungsschutz.de/SharedDocs/publikationen/DE/cyberabwehr/2024-02-19-joint-cyber-security-advisory-englisch.pdf?__blob=publicationFile&v=2',NULL,'Germany and South Korea’s intelligence agencies have issued a joint cyber security advisory, highlighting the threat posed by North Korean cyber actors to the German and Korean defence sectors. and the international community.','2024-02-21 00:01:33','2024-02-21 11:33:54','65d4ed5d22646d0d35dfaa29'),(2056,23,'Earth Uses Geopolitical Lure to Target Taiwan Before Elections','Cobalt Strike - S0154','https://www.trendmicro.com/en_us/research/24/b/earth-lusca-uses-geopolitical-lure-to-target-taiwan.html,https://www.trendmicro.com/content/dam/trendmicro/global/en/research/24/b/earth-lusca-uses-geopolitical-lure-to-target-taiwan-before-elections/ioc-earth-lusca-taiwan.txt',NULL,'A threat actor tracked as Earth Lusca launched a spear phishing campaign using Chinese-Taiwanese relations as a lure to infect targets in Taiwan. The campaign was active between December 2023 and January 2024. The initial infection file contained shortcuts that executed obfuscated JavaScript leading to a Cobalt Strike payload. Stolen documents were used as decoys. Overlaps in victims, malware, location suggest links between Earth Lusca and Chinese company I-Soon.','2024-02-27 00:07:45','2024-02-26 10:28:03','65dc678a947c227beb15295d'),(2057,28,'New Malicious PyPI Packages used by Lazarus','pycryptoenv,pycryptoconf,quasarlib,swapmempool,comebacker','https://blogs.jpcert.or.jp/en/2024/02/lazarus_pypi.html',NULL,'JPCERT/CC confirmed that Lazarus has released malicious Python packages to PyPI, the official Python repository. The packages pycryptoenv, pycryptoconf, quasarlib, and swapmempool contain malware. The package names pycryptoenv and pycryptoconf target typos when installing legitimate packages. The malware is Comebacker, which decodes and executes a DLL sending HTTP requests to C2 servers. The DLL receives and runs executable files. The packages were downloaded 300 to 1200 times, showing Lazarus targets typos for infection.','2024-03-01 00:03:25','2024-03-01 13:35:02','65e0cb765723aa9cfaa6b362'),(2058,5,'North Korean APT37 Used a Maldoc with a VBA self decode technique to inject RokRat','','','','','2024-03-04 15:02:11','2024-03-04 15:02:11',NULL),(2059,6,'Matryoshka : Variant of ROKRAT, APT37 (Scarcruft)','asdad','sada','sad','dsada','2024-03-04 15:52:11','2024-03-04 15:52:11',NULL);
